(8, 1, 'Elantra', 'Элантра', 'sedan', 'elantra_new', '/uploads/model/546279412c23d.png', '', '<h1>Купить Хендай Элантра у официального дилера в Москве</h1>\r\n\r\n<p>Свежая серия &laquo;Элантры&raquo; - это новые технологии и более современный дизайн. &nbsp;Авто Hyundai Elantra во всех модификациях представлено в нашем салоне. В Вашем распоряжении услуги технического центра, а также услуги по страхованию и регистрации новой машины в ГИБДД. &nbsp;</p>\r\n\r\n<p><strong style="font-size: 125%;">Новый авто Хендай Элантра: цены и комплектации</strong><br />\r\nВыбирать есть из чего: доступно пять разнообразных версий, автоматическая и механическая трансмиссия, двигатели на 1.4, 1.6 и 1.8 литров, а также 9 вариантов цветового оформления. Двигатели отличаются особой мощностью и экономичностью, а расцветки &ndash; насыщенностью. Консультанты &laquo;ПИК-Авто&raquo; сориентирует по всем характеристикам и помогут подобрать комплектации Хендай Элантра в автосалоне или во время беседы по телефону.</p>', '<h2>Новый Хендай Элантра в кредит</h2>\r\n\r\n<p>Что пишут в отзывах владельцы нового Хендай Элантра? Мы выделили главные преимущества авто, по мнению автолюбителей.</p>\r\n\r\n<p><strong style="font-size: 125%;">Главные преимущества</strong></p>\r\n\r\n<ul>\r\n	<li><em>Выразительная оптика</em>. В концепции экстерьера &ndash; стреловидные вытянутые фары. Они стали главной изюминкой дизайна.</li>\r\n	<li><em>Высокий уровень безопасности</em>. Защиту в экстренных ситуациях обеспечивает система &laquo;VSM&raquo;. Авто оснащено рядом других устройств и систем, комплексная работа которых гарантирует максимальную безопасность на дороге.</li>\r\n	<li><em>Презентабельный внешний вид</em>. Яркий оригинальный дизайн делает хетчбек заметным на дороге и выгодно выделяет его среди других конкурентов.</li>\r\n	<li><em>Превосходное управление</em>. Оптимальная курсовая устойчивость поддерживает плавный уверенный ход в постоянном режиме.</li>\r\n	<li><em>Отличная проходимость</em>. По отзывам водителей, автомобиль Хендай Элантра отлично справляется со сложными дорожными полотнами. Совершать любые маневры на нем &ndash; невероятно легко и просто!</li>\r\n	<li><em>Множество вещевых отделений</em>. В салоне предусмотрены все нужные &laquo;мелочи&raquo;: подстаканники, перчаточный ящик, кейс для очков, дверные пороги и так далее.</li>\r\n	<li><em>Оригинальная архитектура центральной консоли</em>. Делает общую концепцию дизайна эксклюзивной.</li>\r\n	<li><em>Возможность трансформации пространства</em>. Для перевозки крупногабаритного груза (например, лыж) сложите задние кресла в пропорции 6 к 4.</li>\r\n	<li><em>Удобная аудиосистема</em>. Купить Хендай Элантра (Hyundai Elantra) в Москве у официального дилера предложено в комплекте с многофункциональной аудиосистемой. Подключайте любые гаджеты и наслаждайтесь любимыми треками!</li>\r\n</ul>\r\n\r\n<p><b style="font-size: 125%;">!</b> Для того чтобы ваш выбор был максимально обдуманным и верным, рекомендуем ознакомиться с преимуществами других моделей. У нас возможно, например, <a href="/auto/ford">купить Форд</a>, а также машины от остальных торговых марок с мировым именем.</p>', '<p><strong style="font-size: 125%;">Исключительный дизайн</strong><br />\r\n<strong>Выдающаяся концепция. </strong>Утонченный силуэт делает внешний облик авто невероятно элегантным и стильным. Все изгибы отличаются динамичностью и плавностью. В результате экстерьер получился аэродинамичным, эффектным, ярким.</p>\r\n\r\n<p><strong>Цветовое оформление.</strong> Купить новый Хендай Элантра в кредит возможно практически в любом варианте синего. В основе палитры &ndash; именно этот благородный насыщенный цвет. Что касается других тонов, то в цветовой гамме вы найдете также черный, красный, белый и коричневый.</p>\r\n\r\n<p><strong>Салон.</strong> Внутреннее исполнение продолжает заданную линию динамики и гармонии. А качественная отделка и удобные сиденья делают салон не только красивым, но и комфортным.</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Если вам понравился дизайн Элантры, обратите внимание на похожие модели. Возможно, вам стоит <a href="/auto/ford/fiesta_sd/">купить Форд Фиеста</a> или другое авто.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:19', '2018-02-19 11:07:19'),
