(14, 4, 'Sportage', 'Спортейдж', 'crossover', 'sportage', '/uploads/model/548556ac53e3d.png', '', '<h1>Купить новый Киа Спортейдж (Kia Sportage) у официального дилера в Москве</h1>\r\n\r\n<p><strong>Еще энергичнее и ярче!</strong> Представляем новый городской среднеразмерный кроссовер от ведущего бренда Кореи. Претерпев изменения в дизайне и техническом исполнении, автомобиль стал более комфортным и эстетичным. Российские автолюбители уже оценили новшества: купить новый Киа Спортейдж в кредит решили более 100 000 человек. В &laquo;ПИК-Авто&raquo; вы тоже сможете также принять участие в кредитной программе. Для этого мы выбрали в качестве партнеров более 15 различных банков страны. Все они предлагают лояльные и выгодные условия получения и выплаты займа.</p>\r\n\r\n<p><strong>Новый авто Киа Спортейдж: актуальные цены и комплектации</strong></p>\r\n\r\n<ul>\r\n	<li>Classic;</li>\r\n	<li>Comfort;</li>\r\n	<li>Luxe;</li>\r\n	<li>Prestige;</li>\r\n	<li>Premium.</li>\r\n</ul>\r\n\r\n<p>Подробную информацию по каждой комплектации Киа Спортейдж в автосалоне предоставят менеджеры. А чтобы вы смогли ознакомиться с описанием быстрее, мы подготовили таблицу с характеристиками всех модификаций и разместили ее на сайт.</p>\r\n\r\n<h2>Цена на Киа Спортейдж в кредит</h2>\r\n\r\n<p>&laquo;ПИК-авто&raquo; &ndash; партнер легендарных автомобилестроительных марок России, Германии, Франции, Японии, Кореи и Китая. Как действующий официальный дилер Kia Sportage в Москве, мы вправе формировать прозрачный прайс с умеренными расценками. Помимо прочего, мы можем взять часть расходов наших клиентов на себя.</p>\r\n\r\n<p><strong>Подарки для вас:</strong></p>\r\n\r\n<ul>\r\n	<li>билет до Москвы (спец.предложение для всех жителей регионов РФ);</li>\r\n	<li>страховой полис.</li>\r\n</ul>\r\n\r\n<p><em>Бонусы.</em> Цена на Kia Sportage в кредит включает в себя также ряд дополнительного оборудования. Это парктроник, сигнализация, резина, навигатор и так далее. Причем вы сами выбираете себе презенты! Подробности о подарках &ndash; у наших менеджеров.</p>', '<h2>Автомобиль Киа Спортейдж: отзывы</h2>\r\n\r\n<p>Новый Киа Спортейдж, по отзывам владельцев &ndash; это отличный вариант для России. Кроссовер прекрасно адаптирован под наши условия, демонстрируя превосходную проходимость. Что касается экспертной оценки, то автомобиль получил более 40 различных наград. Народная же любовь измеряется в продажах &ndash; не единожды внедорожник признавали &laquo;Автомобилем года&raquo;.</p>\r\n\r\n<p><strong>Новшества</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Амортизаторы</strong> для отточенной управляемости и лучшего комфорта. Адаптивными устройствами оснастили каждую модель Спортейджа вне зависимости от модификации.</li>\r\n	<li><strong>Подвеска</strong> для сохранения стабильного и уверенного хода. Более модернизированная и надежная подвеска обеспечит плавное торможение.</li>\r\n	<li><strong>Трансмиссия</strong> также обновлена. В механической трансмиссии предусмотрено 6 передач.</li>\r\n	<li><strong>Двигатель</strong> &ndash; еще мощнее. На выбор предложена обширная линейка двигателей: как бензиновых, так и дизельных двигателей. Они рассчитаны на 136 - 184 лошадиные силы. В дизельной версии имеется полный привод, бензиновой &ndash; передний.</li>\r\n</ul>\r\n\r\n<p><strong>Гарантия вашего комфорта</strong><br />\r\nОставьте любые заботы о вашем комфорте соответствующим системам! Оптимальную температуру обеспечит двухзонный контроль климата, современная аудиосистема &ndash; благородное звучание любимых треков, а навигационная система с детализированными картами подскажет верную дорогу.</p>\r\n\r\n<p><strong>На страже вашей безопасности</strong><br />\r\nКроссовер получил 5 звезд за безопасность, по итогам тестов EURONCAP. Это делает его одним из самых надежных авто в мире в своем классе. Результат стал достижимым благодаря целой серии систем обеспечения безопасности. Это и помощь при спуске и подъеме для уверенного хода по наклонным поверхностям, системы курсовой устойчивости и активного управления. Из средств защиты особого внимания заслуживают подушки и шторки безопасности, активные подголовники.</p>', '<p><strong>Стильный с любого ракурса</strong><br />\r\n<em><strong>Дизайн.</strong></em> Смелый, сильный, мощный. Таким и должен быть настоящий внедорожник. Его облик, уверенный и целеустремленный, подвергся качественному рестайлингу. Однако классика бренда, например, стильная радиаторная решетка осталась. Авто Kia Sportage безупречно с точки зрения функциональности, эстетичности и инноваций.</p>\r\n\r\n<p><em><strong>Салон.</strong></em> Сиденья отличаются особой мягкостью и рельефом. Дополнительный комфорт создают такие мелочи, как карманы для вещей в дверях, задний подлокотник, оснащенный подстаканниками и другие отделения.</p>\r\n\r\n<p>Не уверенны в своем выборе? Обратите внимание на другие продукты корейских разработчиков &ndash; вы сможете найти в нашем автосалоне <a href="/auto/hyundai">Hyundai</a>. Мы уверенны, что среди огромного выбора вы подберете оптимальную модель.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:27', '2018-02-19 11:07:27'),
(15, 5, 'Sentra', 'Сентра', 'sedan', 'sentra', '/uploads/model/54999740983f6.png', '', '<h1>Купить новый Ниссан Сентра (Nissan Sentra) у официального дилера в Москве</h1>\r\n\r\n<p><strong>Ощутите восторг движения вместе с легендарным седаном Сентра!</strong> Солидный и благородный, он подчеркнет статус своего владельца, продемонстрировав роскошное внешнее исполнение. Разработчики продумали все до самой мелочи, представив вместительный салон, надежный комплект систем безопасности и инновационные технологии.</p>\r\n\r\n<p>В автосалоне &laquo;ПИК-Авто&raquo; купить новый Ниссан Сентра в кредит предложено по любой из сорока актуальных программ. Их создатели &ndash; ведущие банки России &ndash; позаботились о лояльности каждого условия. Отсюда и низкие процентные ставки, и отсутствие первого взноса. На выбор доступны все модификации модели.</p>\r\n\r\n<p><strong>Новый авто Ниссан Сентра: цены и комплектации</strong></p>\r\n\r\n<ul>\r\n	<li>Comfort;</li>\r\n	<li>Elegance;</li>\r\n	<li>Elegance Plus;</li>\r\n	<li>Connect;</li>\r\n	<li>Plus Connect;</li>\r\n	<li>Tekna.</li>\r\n</ul>\r\n\r\n<p>В любой своей комплектации Ниссан Сентра в автосалоне оснащен всем необходимым для комфортных и приятных поездок. Подробная информация по каждой из модификаций размещена на сайте в виде удобной и простой для понимания таблицы. При возникновении любых вопросов обращайтесь к менеджерам &laquo;ПИК-Авто&raquo;.</p>\r\n\r\n<h2>Цена на Ниссан Сентра в кредит</h2>\r\n\r\n<p>&laquo;ПИК-авто&raquo; - представитель таких именитых брендов, как Opel, Volkswagen, Renault, Skoda и прочих зарубежных компаний. В каталоге собраны также предложения от российских производителей (возможно, например, <a href="/auto/vaz">купить Ладу</a> по бюджетной цене). Официальный дилер Nissan Sentra в Москве или любом другом городе всегда устанавливает максимально выгодные расценки. &laquo;ПИК-Авто&raquo; еще и дарит огромное количество различных подарков.</p>\r\n\r\n<p><strong>О ваших бонусах:</strong></p>\r\n\r\n<ul>\r\n	<li>билет до Москвы для жителей регионов &ndash; бесплатно;</li>\r\n	<li>оформление страховки &ndash; бесплатно;</li>\r\n	<li>полезное оборудование &ndash; бесплатно*.</li>\r\n</ul>\r\n\r\n<p>* Цена на Nissan Sentra в кредит подразумевает платежи за следующие устройства: зимняя резина, навигация, сигнализация, парктроник и так далее. Презент выбирает покупатель. Информация о полном перечне подарков и условиях получения указана на странице &laquo;<a href="/gifts">подарки</a>&raquo;.</p>', '<h2>Автомобиль Ниссан Сентра: отзывы</h2>\r\n\r\n<p>О чем пишут владельцы нового Ниссан Сентра в отзывах? Седан полностью адаптирован для езды в российских условиях. Он создан для динамичной жизни в темпе современного мегаполиса. Впечатляет и немалый уровень экономичности, который достигнут за счет аэродинамичного исполнения. А отдельно автолюбители выделяют комфорт и уют, которые царят в салоне всегда.</p>\r\n\r\n<p><strong>Полный комплект для ваших путешествий</strong><br />\r\n<em>Вместительный багажник.</em> Багажное отделение вмещает груз объемом до 511 л. Таким показателем, кстати, могут похвастаться далеко не все автомобили (разве что седаны бизнес-класса или внедорожники). При этом объем багажника можно увеличить еще больше, сложив задние пассажирские сиденья.</p>\r\n\r\n<p><em>Все системы обеспечения безопасности.</em> Уверенный ход сохраняется всегда и везде благодаря отменной работе антиблокировочной и антибуксовочной систем. Немаловажную роль играет система распределения тормозных усилия и помощь при торможении. Комплекс всех этих систем придаст невероятную уверенность во время вождения.</p>', '<p><strong>Достойный</strong><br />\r\n<em><strong>Дизайн.</strong></em> Отточенный профиль, стремительные линии кузова и динамичный облик. В каждой детали седана чувствуется невероятная элегантность. При этом дизайн особо практичен. Выбранная концепция положительно влияет на экономичность: особые линии аэротрубы позволяют снизить расход топлива. Нельзя не отметить превосходное исполнение оптики: стильные задние фонари с фактурным светодиодным рисунком, передние фары в эксклюзивной форме. Авто Nissan Sentra &ndash; это движение, яркость и блеск.</p>\r\n\r\n<p><em><strong>Салон.</strong></em> Комфорт обеспечит все: и мягкие удобные сиденья, не сковывающие движения, и интуитивно понятная панель управления, и интеллектуальные системы.</p>\r\n\r\n<p>Если дизайн Сентры не пришелся по вкусу, предлагаем обратить внимание на другие модели. Являясь <a href="/auto/renault">официальным дилером Рено</a> и множества прочих мировых брендов, мы представляем огромный ассортимент. Мы уверенны, что в нашем каталоге найдется модель, полностью отвечающая вашим предпочтениям.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:28', '2018-02-19 11:07:28'),
(16, 11, 'Kyron', '', 'suv', 'kyron', '/uploads/model/101001', '', '', '', '', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:29', '2018-02-19 11:07:29'),
(17, 5, 'Juke New', 'Жук', 'crossover', 'juke_new', '/uploads/model/55518edeb4312.png', '', '<h1>Купить Ниссан Жук у официального дилера в Москве</h1>\r\n\r\n<p>Внедорожник, ставший легендой. Авто Nissan Juke &ndash; одна из самых популярных разработок бренда. В первую очередь успех объясняется необычным оригинальным дизайном. &laquo;ПИК-Авто&raquo; как официальный дилер торговой марки подготовил прозрачный прайс на все модификации машины.</p>\r\n\r\n<p><strong style="font-size: 125%;">Новый авто Ниссан Жук: цены и комплектации</strong><br />\r\nНа ваш суд представлено 10 расцветок и 11 различных комплектаций. Предусмотрены шести- и пятиступенчатые механические коробки передач. Благодаря существенному выбору найти нужные комплектации Ниссан Жук в автосалоне &ndash; несложно. Если у вас возникнут какие-либо вопросы, свяжитесь с менеджером &laquo;ПИК-Авто&raquo;.</p>', '<h2>Новый Ниссан Жук в кредит</h2>\r\n\r\n<p>Внушительность, утонченность и яркость &ndash; то, что абсолютно точно характеризует этот внедорожник. Новый Ниссан Жук, по отзывам владельцев, выполнен действительно достойно: он оснащен самыми последними технологиями и системами и продуман в техническом плане в целом. Расскажем об основных преимуществах этой модели.</p>\r\n\r\n<p><strong style="font-size: 125%;">Полезная информация</strong><br />\r\n<strong>Дизайн </strong><br />\r\nСтоит ли говорить, какой фурор произвела внешность Жука на мировом авторынке? Совершенно новый подход к дизайну пришелся по нраву водителям со всего мира, и авто мгновенно снискало успех в Японии, странах Европы, России и так далее.</p>\r\n\r\n<p><strong>Безопасность и управление</strong><br />\r\nПроизводитель предлагает купить Ниссан Жук (Nissan Juke) в Москве у официального дилера с богатым комплектом устройств активной и пассивной защиты. Среди них троица систем &laquo;EBD&raquo;, &laquo;ABS&raquo;, &laquo;ESP&raquo;, которые в совокупности обеспечивают уверенный и плавный ход в бесперебойном режиме. Среди других любопытных технологий: мониторинг &laquo;слепых&raquo; зон, видеообзор и многое другое.</p>\r\n\r\n<p><strong>Комфорт</strong><br />\r\nВеликолепная отделка салона гарантирует непревзойденный комфорт в любых поездках. Спортивные сиденья &ndash; оригинальная разработка &laquo;NISSAN&raquo; - отличаются особой гармонией жесткости и мягкости: они отлично поддерживают спину, но при этом приятны на ощупь. Водители автомобиля Ниссан Жук в отзывах делятся, что даже продолжительные путешествия проходят невероятно легко. &nbsp;</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Вам нравится продукция японских мастеров? Рекомендуем изучить полный ассортимент авто. Есть вероятность, что вы захотите, например, <a href="/auto/skoda">купить Шкода</a>. Эта корпорация выпускает невероятно стильные дизайнерские автомобили. Возможно, среди них вы найдете модель по своим предпочтениям.</p>', '<p><strong style="font-size: 125%;">Прорыв в автомобильной моде</strong><br />\r\n<strong>Совершенно новый. </strong>Дизайн &laquo;JUKE&raquo; произвел настоящий фурор в сфере автомобилестроительной моды. И в первую очередь из-за необычной формы кузова. Приплюснутая передняя часть авто и выразительная эксклюзивная оптика стали основой всей концепции.</p>\r\n\r\n<p><strong>Цветовая гамма.</strong> В каких цветах производитель предложил купить новый Ниссан Жук в кредит? В распоряжении автолюбителей целых десять разнообразных оттенков &ndash; от ослепительного белого до насыщенного черного, от яркого желтого до стандартного серебристого.</p>\r\n\r\n<p><strong>Салон.</strong> Здесь вы однозначно насладитесь невероятным комфортом. При этом салон продуман еще и в дизайнерском плане. Яркие детали и стильные решения нашли отражение в интерьере Жука.</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Дизайн этой модели совершенно уникален и исключителен. Но если говорить об общем исполнении кузова, то есть сходства с другими авто. Например, возможно, вам понравится Ай Икс 35. Напомним, что <a href="/auto/hyundai/ix_35/">купить Хендай Ай Икс 35</a> также можно в нашем автосалоне.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:31', '2018-02-19 11:07:31'),
