(19, 5, 'Tiida New', 'Тиида', 'hatchback_5', 'tiida_new', '/uploads/model/560c191e684a7.png', '', '<h1>Купить новый Ниссан Тиида (Nissan Tiida) у официального дилера в Москве</h1>\r\n\r\n<p><strong>Волнующий, притягивающий взгляды.</strong> Невероятно утонченный и выдающийся, этот автомобиль стал эталоном и классикой. С роскошным внешним исполнением и богатым техническим оснащением, он обрел популярность на ключевых рынках, оправдав надежды самых искушенных автолюбителей.</p>\r\n\r\n<p>&laquo;ПИК-Авто&raquo; - официальный представитель легендарного бренда &laquo;NISSAN&raquo;. У нас можно купить новый Ниссан Тиида в кредит по лояльным программам от ведущих банков страны. Всего насчитывается 40 вариантов автокредитования, а их разработчиками являются более 15 главных финансовых организаций РФ.</p>\r\n\r\n<p><strong>Новый авто Ниссан Тиида: возможные цены и комплектации</strong></p>\r\n\r\n<ul>\r\n	<li>Comfort;</li>\r\n	<li>Elegance и Elegance Plus;</li>\r\n	<li>Connect и Plus Connect;</li>\r\n	<li>Tekna.</li>\r\n</ul>\r\n\r\n<p>Что включено в ту или иную комплектацию Ниссан Тиида в автосалоне? Узнайте прямо сейчас. Представляем простую и удобную таблицу с подробным описанием всех параметров и характеристик автомобиля. Если информации на сайте окажется недостаточно, свяжитесь с менеджерами &laquo;ПИК-Авто&raquo; для получения персональной консультации.</p>\r\n\r\n<h2>Цена на Ниссан Тиида в кредит</h2>\r\n\r\n<p>&laquo;ПИК-авто&raquo; сотрудничает со следующими автомобилестроительными компаниями: Renault, Kia, Great Wall, Opel, Skoda, у нас также можно <a href="/auto/volkswagen">купить Volkswagen</a>, Datsun, Lifan, Huyindai. Оставаясь лидерами в своих странах, все они успешно завоевали еще и российский рынок. Прямые поставки и партнерство с несколькими производителями одновременно не могут не влиять на ценообразование позитивно. Официальный дилер Nissan Tiida в Москве &laquo;ПИК-Авто&raquo; разработал демократичный прайс, а в качестве бонусов выбрал полезное оборудование и ряд других нужных презентов.</p>\r\n\r\n<p><strong>Только для тех, кто выберет &laquo;ПИК-Авто&raquo;:</strong></p>\r\n\r\n<ul>\r\n	<li>бесплатная дорога до столицы: приезжайте в Москву за наш счет, а возвращайтесь уже на личном автотранспорте;</li>\r\n	<li>бесплатное оформление страхового полиса: заботы о страховании мы также готовы взять на себя.</li>\r\n</ul>\r\n\r\n<p><em>Еще больше бонусов.</em> Отметим, что цена на Nissan Tiida в кредит, можно сказать, итоговая. Ведь в указанную стоимость включены ценные подарки. Мы дарим всем своим клиентам навигаторы и парктроники, комплекты фирменных зимних шин и сигнализационные системы. Кстати, наши покупатели выбирают <a href="/gifts">подарки</a> самостоятельно.</p>', '<h2>Автомобиль Ниссан Тиида: отзывы</h2>\r\n\r\n<p>Какие отзывы владельцев нового Ниссан Тиида встречаются? Абсолютное большинство из них остается положительными. Водители довольны и изящным внешним исполнением, и широкой оснащенностью авто. Богатый выбор дополнительного оборудования и продуманные системы безопасности впечатляют. В связи с этим машина обретает универсальность, оставаясь актуальной и для больших семей, и для деловых персон, и для тех, чья стихия &ndash; путешествия.</p>\r\n\r\n<p><strong>На страже Вашей безопасности</strong><br />\r\nПротивостояние сильнейшим механическим ударам &ndash; задача кузова, который оснащен прочной конструкцией. В системы защиты пассажиров и водителя входят новейшие фронтальные и боковые подушки безопасности, а также шторки.</p>\r\n\r\n<p><strong>Цепляющий комфорт</strong><br />\r\nПревосходный обзор и эффективная подвеска обеспечивают легкость и уверенность управления. За комфорт внутри салона отвечают двухзонная система климат-контроль, автоматический бесключевой доступ к машине, автоматическая кнопка включения двигателя (действительно для определенных комплектаций).</p>', '<p><strong>Стильный, как бы вы не посмотрели</strong><br />\r\n<em><strong>Дизайн.</strong></em> Если бы к Тииде нужно было подобрать синонимы, то слова &laquo;роскошь&raquo;, &laquo;изыск&raquo;, &laquo;утонченность&raquo; подошли бы точнее всего. В каждой детали прослеживаются смелые дизайнерские решения. Благодаря амбициям и превосходному вкусу инженеров появились потрясающий спойлер, элегантная решетка радиатора в V-силуэте. Утонченные грани задают особую динамику. Авто Nissan Tiida &ndash; это движение, яркость и блеск.</p>\r\n\r\n<p><em><strong>Салон.</strong></em> Типичность - не отличительная черта Тииды. Но как истинный хэтчбэк автомобиль оснащен вместительным и светлым салоном, большим багажником, множеством вещевых отделений и так далее.</p>\r\n\r\n<p>Не удовлетворены дизайном авто? Напомним, что мы являемся <a href="/auto/renault">официальным дилером Рено</a> и ряда других марок. Мы уверенны: в представленном каталоге каждый сможет найти модель по своему вкусу.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:33', '2018-02-19 11:07:33'),
(20, 5, 'Teana', 'Теана', 'sedan', 'teana', '/uploads/model/560c197022cab.png', '', '<h1>Купить новый Ниссан Теана (Nissan Teana) у официального дилера в Москве</h1>\r\n\r\n<p><strong>Премиальный во всех отношениях.</strong> Теана демонстрирует восхитительно плавный и уверенный ход, отличную управляемость и изысканный дизайн. С &laquo;ПИК-Авто&raquo; вы сможете выгодно купить новый Ниссан Теана в кредит. На выбор доступно 40 программ кредитования.</p>\r\n\r\n<p><strong>Новый авто Ниссан Теана: актуальные цены и комплектации</strong><br />\r\nВ зависимости от модификации автомобиль оснащен теми или иными уникальными системами безопасности. Это и контроль слепых зон, и мониторинг рядности движения и так далее. Кроме того, предложены современные инновационные сиденья. Для вашего удобства мы подготовили читабельную таблицу с указанием всех параметров по каждой версии авто.</p>\r\n\r\n<p>Все актуальные комплектации Ниссан Теана в автосалоне имеются в наличии. Свяжитесь с нашими менеджерами для получения персональной консультации специалиста. Или изучите информацию об автомобиле и вариантах кредитования самостоятельно.</p>\r\n\r\n<h2>Цена на Ниссан Теана в кредит</h2>\r\n\r\n<p>Мы сотрудничаем одновременно с десятками брендами (у нас можно <a href="/auto/volkswagen">купить Фольксваген</a>, или Хендай, Лифан, Шевроле и проч.). Это позволяет нам сохранять умеренную политику в отношении ценообразования. Кроме того, как официальный дилер Nissan Teana в Москве, мы готовы предложить фирменные устройства в подарок. Действительны и другие акции.</p>\r\n\r\n<p><strong>Купим за вас:</strong></p>\r\n\r\n<ul>\r\n	<li>билет до Москвы;</li>\r\n	<li>страховой полис.</li>\r\n</ul>\r\n\r\n<p>Цена на Nissan Teana в кредит подразумевает нулевой платеж за парктроники, зимние шины, навигатор, сигнализацию, видеорегистратор и так далее. Узнайте, какие презенты вы сможете получить уже сегодня на странице &laquo;<a href="/gifts">подарки</a>&raquo;.</p>', '<h2>Автомобиль Ниссан Теана: отзывы</h2>\r\n\r\n<p>В отзывах владельцы нового Ниссан Теана пишут о достойной экономичности, впечатляющем дизайне и отличной системе безопасности. Эти преимущества можно назвать ключевыми. Что касается наиболее важных улучшений модели, то здесь стоит упомянуть об обновленных амортизаторах, задней подвеске и вариаторе.</p>\r\n\r\n<p><strong>ТОП5 преимуществ:</strong></p>\r\n\r\n<ol>\r\n	<li>упрочненный кузов;</li>\r\n	<li>технологии интуитивной защиты;</li>\r\n	<li>вместительный салон;</li>\r\n	<li>мягкая и приятная на ощупь обивка;</li>\r\n	<li>аэродинамичный элегантный силуэт.</li>\r\n</ol>', '<p><strong>Благородный</strong><br />\r\n<em><strong>Дизайн.</strong></em> Nissan Teana &ndash; авто бизнес-класса - следовательно, и дизайн у него соответствующий. Элегантность и особый шарм ощущаются всюду: в экспрессивном экстерьере, насыщенных изысканных оттенках, эксклюзивных деталях и завораживающем интерьере.</p>\r\n\r\n<p><span style="font-size:16px;"><strong>!</strong></span> Не понравилось внешнее оформление машины? Предлагаем оценить визуальные преимущества других моделей. Напомним, что &laquo;ПИК-Авто&raquo; представляет не только Ниссан, но и является <a href="/auto/renault">официальным дилером Рено</a> и других марок.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:34', '2018-02-19 11:07:34'),
(21, 10, 'Celliya', 'Селия', 'sedan', 'celliya', '/uploads/model/560c396f2ee1c.png', '', '<h1>Купить Лифан Селия у официального дилера в Москве</h1>\r\n\r\n<p>Динамика и ультрасовременность сопровождают каждую модель &laquo;KIA&raquo;. Представленный седан уже обрел любовь покупателя, став одним из самых продаваемых в своем классе. Авто Lifan Celiya в любых комплектациях вы найдете в нашем салоне. Помимо этого, возможно воспользоваться остальными сопутствующими услугами (от регистрации в ГИБДД до сложного ремонта).</p>\r\n\r\n<p><strong style="font-size: 115%;">Новый авто Лифан Селия: цены и комплектации</strong><br />\r\nВне зависимости от версии машина считается адаптированной моделью для езды по российским дорогам. Во-первых, она имеет увеличенные объемы емкости аккумулятора. Во-вторых, надежную защиту практически каждой детали (например, радиатор защищен составом, который противодействует агрессивной внешней среде).</p>\r\n\r\n<p>Стандартные комплектации Лифан Селия в автосалоне включают в себя наличие системы &laquo;EBS&raquo;, электропривода, задних дисковых тормозов, систему &laquo;ABS&raquo; и передних дисковых тормозов. Подробная таблица с описанием того, что идет в той или иной модификации, доступна на этой странице.</p>', '<h2>Новый Лифан Селия в кредит: преимущества</h2>\r\n\r\n<p>Смело отправляйтесь в путь и не переживайте за безопасность: разработчики уже все предусмотрели. То же касается и комфорта: есть все необходимое для того, чтобы поездки приносили исключительно позитивные эмоции. Об этом пишут не только создатели авто, но и непосредственно владельцы нового Лифан Селия в отзывах о нем.</p>\r\n\r\n<p><strong style="font-size: 115%;">Беспрекословная система безопасности</strong><br />\r\nВ первую очередь инженеры укрепили кузов. Так, днище, пороги и арки колес покрыли специальным антикоррозийным составом. Затем седан оснастили различными опциями, устройствами, системами. Например, для комфортного и максимального безопасного совершения маневров предусмотрены камера заднего вида и задние датчики парковки. Последние приборы, кстати, значительно облегчают процесс парковки. С помощью ультразвука они подают сигналы, которые преобразуются в изображения и затем транслируются на дисплее бортового компьютера.</p>\r\n\r\n<p><b style="font-size: 115%;">!</b> Детальное оснащение зависит от того, какой комплектации вы решите купить Лифан Селия (Lifan Celiya) в Москве у официального дилера.</p>\r\n\r\n<p><strong style="font-size: 115%;">Однозначный комфорт </strong><br />\r\nПростор и отделка изумительного качества &ndash; первое, что бросается в глаза при посадке в салон. В числе характеристик интерьера остаются утонченность, эргономичность и лаконичность.</p>\r\n\r\n<p><b style="font-size: 115%;">!</b> Автомобиль Лифан Селия, по отзывам водителей, отлично подходит для путешествий и поездок загород: здесь есть большой багажник.</p>\r\n\r\n<p><strong style="font-size: 115%;">Рестайлинг и обновления</strong><br />\r\n<em>Напомним, данная версия седана вышла в 2014 году.&nbsp; Свежая разработка была представлена как замена актуальной тогда модели &ndash; &laquo;Бриз&raquo;.</em></p>\r\n\r\n<p><em>Если вам не понравился автомобиль, однако его ценовая категория &ndash; искомая, попробуйте <a href="/auto/ravon">купить Равон</a>. На эти машины потребуется примерно такой же бюджет.</em></p>', '<p><strong style="font-size: 115%;">Со спортивным характером</strong><br />\r\n<strong>Цветовое оформление.</strong> Бренд &laquo;LIFAN&raquo; славится своей яркой и красочной цветовой гаммой. В палитре вы встретите шесть разнообразных оттенков &ndash; от привычных стандартных до самых непредсказуемых и эксклюзивных.&nbsp;</p>\r\n\r\n<p><strong>Дизайн.</strong> Выразительный облик примечателен спортивным исполнением корпуса и струящимися кузовными линиями. Купить новый Лифан Селия в кредит стоит всем любителям спортивного и вместе с тем весьма элегантного стиля.</p>\r\n\r\n<p><strong>Интерьер.</strong> Утонченность послужила постулатом для оформления салона. Все элементы интерьера гармонируют друг с другом, создавая лаконичную атмосферу.</p>\r\n\r\n<p><em>Понравился дизайн? Но не устраивает цена или технические характеристики модели? Обратите внимание на другие машины. Напомним, у нас можно <a href="/auto/ford/fiesta_sd">Форд Фиеста</a>, которая имеет близкую дизайнерскую концепцию.</em></p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:35', '2018-02-19 11:07:35'),
