(26, 8, 'GO-cross', 'Го-кросс', 'crossover', 'go_cross', '/uploads/model/56e80a9d43cab.png', '', '', '', '', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:38', '2018-02-19 11:07:38'),
(27, 2, 'Logan NEW', 'Логан', 'sedan', 'logan_new', '/uploads/model/589dc39a512c7.png', '', '<h1>Купить новый Рено Логан (Renault Logan) у официального дилера &laquo;ПИК-Авто&raquo; в Москве</h1>\r\n\r\n<p><strong>Еще больше, еще красивее, еще лучше!</strong> Представляем обновленную версию легендарного Рено Логан. Оснащенный интеллектуальными системами и выполненный с отменным вкусом, он прослужит исправно и верно в течение всего срока эксплуатации.</p>\r\n\r\n<p>Чтобы купить новый Рено Логан в кредит, вам не нужно иметь солидную сумму для закрытия первого взноса. Приезжайте с паспортом и правами, а возвращайтесь уже на личном автомобиле. Достаточно выбрать любую из предложенных кредитных программ и не забыть забрать полезные подарки от нашего автосалона.</p>\r\n\r\n<p><strong>Новый авто Рено Логан: все цены и комплектации</strong><br />\r\nЧто касается модификаций, то модель выполнена в версиях COMFORT, LUXE, PRIVILEGE ACCESS и PRIVILEGE. Узнать, чем они отличаются друг о друга, вы сможете с помощью простой и удобной таблицы.</p>\r\n\r\n<p>Отметим, что вне зависимости от комплектации Рено Логан в нашем автосалоне впечатляет своей оснащенностью. Здесь предусмотрено все для ежедневных приятных и комфортных поездок по мегаполису.</p>\r\n\r\n<h2>Цена на Рено Логан в кредит и подарки от автосалона</h2>\r\n\r\n<p>Официальный дилер Renault Logan в Москве &laquo;ПИК-Авто&raquo; представляет еще десятки разнообразных моделей от других компаний. Так, возможно <a href="/auto/skoda">купить Шкода</a>, Датсун, Лифан, Лада, Хендай, Киа, Ниссан, Грейт Вол, Шевроле. Партнерство с многочисленными автопроизводителями позволяет нам предлагать клиентам действительно умеренный прайс с низкими ценами. Более того, компенсировать расходы наших покупателей.</p>\r\n\r\n<p>В дар от &laquo;ПИК-Авто&raquo;:</p>\r\n\r\n<ul>\r\n	<li>билет до столицы;</li>\r\n	<li>страховой полис;</li>\r\n	<li>фирменное полезное оборудование.</li>\r\n</ul>\r\n\r\n<p>Наша цена на Renault Logan в кредит подразумевает нулевые платежи за целый комплекс полезных устройств. Причем подарки от автосалона вы выбираете самостоятельно. Вы сможете получить комплект надежных зимних шин, современный парктроник, многофункциональную навигационную систему и другие приборы совершенно бесплатно! Подробные сведения относительно актуальных акций вы найдете в разделе &laquo;<a href="/gifts">подарки</a>&raquo;.</p>', '<h2>Автомобиль Рено Логан: отзывы</h2>\r\n\r\n<p>Что вы обнаружите, если решите прочитать отзывы владельцы нового Рено Логан? Автолюбители отмечают особую практичность машины. Он оснащен вместительным багажником на 510 литров (кстати, весьма высокий показатель для авто данного класса), множеством мелких отделений для вещей и, конечно, различными развлекательными и информационными системами.</p>\r\n\r\n<p><strong>Позвольте себе больше!</strong><br />\r\nСобираетесь в путешествие? Или планируете перевезти крупногабаритный груз? Сложите задние сиденья, разместите груз в освободившемся пространстве и смело отправляйтесь в путь. А для хранения мелких вещей воспользуйтесь специальным отделением над консолью, карманами в дверцах или вместительным перчаточным ящиком.</p>\r\n\r\n<p><strong>Наслаждайтесь комфортом в режиме 24/7</strong><br />\r\nВ любую погоду микроклимат в салоне остается невероятно комфортным. Это возможно благодаря системам климат-контроля. Что касается развлечений, то аудиосистема отличается благородным и красивым звучанием, а также многофункциональностью.</p>', '<p><strong>Эстетика, заслуживающая вашего внимания</strong><br />\r\n<em><strong>Дизайн.</strong></em> Авто Renault Logan недаром называют &laquo;эталоном гармонии&raquo;. Здесь соблюден единый лаконичный стиль. Есть и плавность кузовных линий, и стремительность всего силуэта, и креативные дизайнерские компоненты.</p>\r\n\r\n<p><em><strong>Салон.</strong></em> В новой версии седан стал еще вместительнее и просторнее, еще комфортнее и удобнее. Теперь ширина (на уровне локтей) салона достигает отметки в 1434 мм. Предлагаем ознакомиться с фотографиями модели и оценить ее визуальные преимущества.</p>\r\n\r\n<p><span style="font-size:16px;"><strong>!</strong></span> Дизайн не пришелся по вкусу? Не забывайте, что &laquo;ПИК-Авто&raquo; не только представляет марку Рено, но и является <a href="/auto/datsun">официальным дилером Датсун</a>, Лифан, Хендай, Ниссан и так далее. В огромном каталоге автомобилей вы обязательно найдете ту, что оправдает ваши ожидания.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:38', '2018-02-19 11:07:38');
