(32, 1, 'Solaris Sedan', 'Солярис', 'sedan', 'new_solaris_sedan', '/uploads/model/589dd8b5173cc.png', '', '<h1>Купить новый Хендай Солярис (Hyundai Solaris) у официального дилера в Москве</h1>\r\n\r\n<p><strong>Невероятно стильный и динамичный.</strong> Ощутите полный восторг от движения! В нашем автосалоне вы сможете выгодно купить новый Хендай Солярис в кредит. Обновленный и усовершенствованный, этот автомобиль стал еще удобнее, комфортнее и безопаснее.</p>\r\n\r\n<p><strong>Новый авто Хендай Солярис: цены и комплектации</strong><br />\r\nВ базовых версиях предусмотрены передние и задние брызговики, а также надежные системы ABS, EBD и проч. Узнать, что еще включено в ту или иную модификацию, вы сможете прямо сейчас. Предлагаем к просмотру читабельную и понятную таблицу характеристик.</p>\r\n\r\n<p>Кстати, чтобы вы ни выбрали, стандартные или полные комплектации Хендай Солярис в автосалоне, мы подарим вам полезные подарки, а также компенсируем расходы по страховке.</p>\r\n\r\n<h2>Цена на Хендай Солярис в кредит</h2>\r\n\r\n<p>Официальный дилер Hyundai Solaris в Москве &laquo;ПИК-Авто&raquo; сотрудничает с ведущими мировыми брендами в сфере автомобилестроения. Это позволяет нам не только формировать лояльный прайс-лист, но и брать часть клиентских расходов на себя.</p>\r\n\r\n<p>Подарки:</p>\r\n\r\n<ul>\r\n	<li>билет до столицы;</li>\r\n	<li>страховой полис;</li>\r\n	<li>полезное оборудование.</li>\r\n</ul>\r\n\r\n<p>Цена на Hyundai Solaris в кредит уже включает в себя стоимость сигнализации, навигации, зимних шин, парктроников и проч. Ознакомьтесь с подробной информацией о презентах в разделе &laquo;<a href="/gifts">подарки</a>&raquo;.</p>', '<h2>Автомобиль Хендай Солярис: отзывы</h2>\r\n\r\n<p>В отзывах владельцы нового Хендай Солярис говорят о выдающейся системе безопасности. Предусмотрены шесть подушек безопасности, включая фронтальные и боковые, антиблокировочная система, преднатяжители, шторки безопасности и многое другое.</p>\r\n\r\n<p><em>Экономичность.</em> В своем классе Солярис демонстрирует относительную экономичность, расходуя 5,9 литров на каждые 100 км.</p>\r\n\r\n<p><em>Комфорт.</em> Здесь вы найдете все для приятных и комфортабельных поездок. Карманы для хранения небольших вещей, удобные и мягкие подлокотники, многофункциональную аудиосистему. Для облегчения управления установлена камера заднего вида, которая поможет ориентироваться на парковке или дороге.</p>', '<p><strong>Премиальный</strong><br />\r\n<em><strong>Дизайн.</strong></em> Hyundai Solaris &ndash; авто с изысканным и элегантным дизайном. Насыщенные контрасты здесь гармонируют с мягкими очертаниями силуэта. Особого внимания заслуживает оптика. Она необычайно выразительна и эффективна в работе. Предлагаем самостоятельно оценить преимущества машины и просмотреть фотографии.</p>\r\n\r\n<p><em><strong>Салон.</strong></em> Просторный и вместительный, он снабжен множеством интеллектуальных и развлекательных систем. Любые даже самые дальние и долгие поездки проходят в максимальном комфорте.</p>\r\n\r\n<p><span style="font-size:16px;"><strong>!</strong></span> Если дизайн не пришелся вам по вкусу, обратите внимание на другие автомобили. Наш салон является <a href="/auto/renault">официальным дилером Рено</a> и ряда других марок.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:42', '2018-02-19 11:07:42'),
(33, 1, 'Solaris Hatchback', 'Солярис', 'hatchback_5', 'new_solaris_hatch', '/uploads/model/589dda144f221.png', '', '<h2><b>Hyundai</b><b> </b><b>Solaris</b><b> </b><b>Hatchback</b><b> 2014</b></h2> <p>Оригинальный Hyundai Solaris 2014 в кузове хэтчбек &ndash; это невероятно стильный и динамичный автомобиль с выразительной внешностью и прекрасными техническими характеристиками. Горячо любимый российскими автолюбителями, он не утратил своей популярности и после рестайлинга: заказать Hyundai Solaris Hatchback 2014 стремятся те, кто желает приобрести качественную машину по демократичной цене.</p> <p>В результате изменений, внесенных дизайнерами концерна в экстерьер автомобиля, новый Солярис приобрел стильную решетку радиатора, выразительную штамповку по кузову и капоту и укрупненный передний бампер. Особый шик машине придает и вытянутая передняя оптика. Салон Hyundai Solaris 2014 практически не изменился: дизайнеры добавили лишь более качественную обивку сидений и кармашки для вещей в задних дверцах, а также сделали панель более эргономичной. В багажное отделение машины входит до 370 литров груза:  здесь с легкостью разместится все необходимое, поэтому купить новый Хендай Солярис 2014 стоит в том числе и в качестве семейного автомобиля. Несмотря на отсутствие глобальных изменений, машина приобрела более спортивный облик. При этом цена на Хендай Солярис хэтчбек 2014 года остается весьма доступной.</p> <h3><b>Особенности модели</b></h3> <p>Как и весь модельный ряд Хендай, Солярис может похвастаться качественным техническим оснащением. В этом автомобиле нет ничего лишнего. В стандартное оборудование в базовой комплектации входят:</p> <ul>     <li><p>&mdash; подушки 	безопасности водителя и переднего 	пассажира;</p></li>     <li><p>&mdash; системы 	ABS 	и 	EBD;</p></li>     <li><p>&mdash; электропривод 	передних стекол;</p></li>     <li><p>&mdash; атермальное 	остекление;</p></li>     <li><p>&mdash; регулировка 	рулевой колонки по вылету и углу наклона;</p></li>     <li><p>&mdash; радиоподготовка 	на 4 динамика;</p></li>     <li><p>&mdash; центральный 	замок;</p></li>     <li><p>&mdash; иммобилайзер.</p></li> </ul> <h3><b>Обзор</b><b> технических характеристик  и комплектаций</b></h3> <p>Максимальная подготовленность к  бесперебойной эксплуатации в жестких российских условиях &ndash; главное достоинство Hyundai Solaris 2014.  Хэтчбек выпускается с двумя типами бензиновых двигателей: мотором объемом 1,4 л (107 л.с.) и 1,6 л (123 л.с.). Водители, в зависимости  от своей манеры вождения, могут отдать предпочтение автомобилям как с механической, так и с автоматической трансмиссией.</p> <p>Производитель предлагает Хендай Солярис Хэтчбек в трех основных комплектациях: Activity, Comfort и Elegance. Оборудование автомобилей разновидности Comfort расширено за счет современной аудиосистемы, кондиционера, полного электропривода и подогрева передних сидений. В комплектацию Elegance включена современная мультимедийная система, задние датчики парковки, оригинальные ручки и зеркала в цвет кузова. Окончательная цена на новый Хендай Солярис Хэтчбек зависит от конкретной комплектации.</p> <p>В автосалоне &laquo;ПИК-Авто&raquo; можно купить новый Солярис хэтчбек в кредит и за наличный расчет. Являясь официальным дилером марки, мы предлагаем приобрести весь модельный ряд Хендай на выгодных условиях! Более подробную информацию о Hyundai Solaris 2014 можно получить по телефонам 8 (495) 644-44-56 или 8 (800) 333-36-44 (звонок по России бесплатный).</p>', '', '', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:43', '2018-02-19 11:07:43'),
