(35, 4, 'SOUL', 'Соул', 'hatchback_5', 'soul', '/uploads/model/589ec9533d6e4.png', '', '', '', '', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:46', '2018-02-19 11:07:46'),
(36, 8, 'mi-DO', 'Ми-До', 'hatchback_5', 'mi_do', '/uploads/model/58a5fcf492706.png', '', '<h1>Купить Датсун ми-До (Datsun mi-Do) в Москве у официального дилера</h1>\r\n\r\n<p>Хэтчбек Датсун ми-До &ndash; это практичность при весьма привлекательной цене. Данные японские автомобили появились немного позже своих собратьев седанов Он-До, но практика показала, что уступать им в продаже более маневренные японцы с большими багажниками не собираются. Купить Датсун ми-До новый в кредит на сегодняшний день желают многие автомобилисты нашей страны и их стремление вполне обосновано оптимальными условиями комфорта, который дарят данные транспортные средства.</p>\r\n\r\n<p>Позволить своим клиентам ознакомиться с внушительным ассортиментом вариаций японских хэтчбеков способна сеть наших автосалонов. Компания &laquo;ПИК-Авто&raquo; - официальный дилер Datsun mi-Do в Москве, ввиду чего наши менеджеры готовы предложить вашему вниманию лучшие условия сотрудничества. При этом помимо японского автопрома, мы также даем возможность клиентам ознакомиться с другими автомобилями, созданными известными автопроизводителями со всего мира. С нами вы сможете изучить модельный ряд Фольксваген, Рено, Лада, Шкода, подобрав при этом автомобиль, который бы соответствовал всем вашим требованиям относительно вместительности, комфорта, внешнего вида и прочих параметров. На сегодняшний день мы наладили сотрудничество с 15 крупнейшими автопроизводителями со всего мира.</p>', '<h2>Новый Датсун ми-До в кредит</h2>\r\n\r\n<p>Компания Датсун, являющаяся дочерним предприятием известнейшего японского автопроизводителя Ниссан, предлагает жителям нашей страны приобретать автомобили с достаточно богатой комплектаций. Желая купить в кредит Датсун ми-До в Москве, уже в стандартных модификациях транспортных средств вы найдете:</p>\r\n\r\n<ul>\r\n	<li>Отменную шумоизоляцию;\r\n	<p>Инженеры компании тщательным образом поработали над шумоподавлением. Следовательно, в моменты езды вы можете наслаждаться любимыми музыкальными композициями, не отвлекаясь на различный внешний шум.</p>\r\n	</li>\r\n	<li>Высокие показатели надежности и безопасности;\r\n	<p>После недавно проведенного рестайлинга цена на Datsun mi-Do осталась по-прежнему доступной. При этом производитель внес колоссальное количество изменений в аспект безопасности своего транспортного средства. Пакет систем пассивной и активной защиты был значительным образом расширен, а кузов стал еще более прочным благодаря новым химическим средствам.</p>\r\n	</li>\r\n	<li>Недорогое обслуживание и экономичность;\r\n	<p>Изучая новый Датсун ми-До отзывы владельцев, вы узнаете, что транспортное средство не требует больших капиталовложений в процессе обслуживания. Детали автомобиля находятся в среднем ценовом сегменте, а в процессе езды его потребление топлива можно назвать предельно оптимальным при мощности в 87 л.с.</p>\r\n	</li>\r\n	<li>Плавный и безопасный ход;\r\n	<p>Рестайлинговая версия авто Datsun mi-Do может похвастать перед своим владельцем превосходной маневренностью и плавным ходом, как в городе, так и на трассе. За счет рассчитанной подвески этот автомобиль не подведет ни на одном вираже.</p>\r\n	</li>\r\n	<li>Новое звучание.\r\n	<p>Для создания особой атмосферы в салоне, японские специалисты интегрировали в свой автомобиль инновационное звуковое оборудование. Встроенные многофункциональные аудиосистемы гарантированно подарят уникальные позитивные впечатления в процессе движения.</p>\r\n	</li>\r\n</ul>', '<h2>Цена на Датсун ми-До</h2>\r\n\r\n<p>Обновленный хэтчбек Датсун ми-До &ndash; это универсальный автомобиль, который своим внешним исполнением удовлетворит требования практически каждого автомобилиста, ценящего практичность. Рассматривая комплектации Датсун ми-До в автосалоне нашей компании, вы познакомитесь с 6 различными расцветками транспортного средства, среди которых вы обязательно подберете подходящую для себя. Причем, бампер, крылья, капот &ndash; всё было создано в предельно сдержанном современном стиле.</p>\r\n\r\n<p>Салон автомобиля, также, как и экстерьер, весьма лаконичен, без излишеств. При этом рассматривая более детально автомобиль Датсун ми-До отзывы, вы отметите высокое качество используемых декоративных материалов. В этом и во всех остальных показателях автомобиль практически полностью отображает своего собрата по конвейеру, седан Он-До.</p>\r\n\r\n<p>Примечательной особенностью модели ми-До является тот факт, что ее дизайнерские решения практически полностью схожи с Калиной, над которой работали инженеры Лада. В нашем ассортименте вы, в частности также сможете купить Лада Калина по более чем выгодной цене.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:47', '2018-02-19 11:07:47'),
(37, 12, 'Patriot', 'Патриот', 'suv', 'patriot', '/uploads/model/58a6015e4e048.png', '', '', '', '', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:48', '2018-02-19 11:07:48'),
(38, 7, 'Octavia', 'Октавия', 'sedan', 'octavia', '/uploads/model/58a602c727aae.png', '', '<h1>Купить Шкода Октавия (Skoda Octavia) в Москве у официального дилера</h1>\r\n\r\n<p>Исключительный дизайн, превосходно сочетающийся с невероятной динамикой и практичностью - вот, что готовы предложить новые автомобили Шкода Октавия своим владельцам. Регулярная модернизация технологий производства, а также внимательное отношение опытных инженеров к процессу создания транспортного средства, позволили доказать всем новоиспеченным владельцам этих чешских автомобилей, что совершенству нет предела. При этом комплектации Шкода Октавия в автосалоне могут быть самыми разнообразными, удовлетворяющими требования даже самого внимательного к мелочам автомобилиста.</p>\r\n\r\n<p>Наша компания &laquo;ПИК-Авто&raquo;, в свою очередь, предлагает вам купить Шкода Октавия новый в кредит на наиболее выгодных для себя условиях. Вас ждут 17 различных модификаций седана, укомплектованных двигателями объемом от 1.4 до 2 литров включительно. Также, наших клиентов обязательно порадует гибкая ценовая политика, которую предлагают наши автосалоны. Наладив плотное сотрудничество с 15 крупнейшими производителями автомобилей со всего мира, мы предоставляем оптимальные условия экономии финансовых средств. В частности, на сегодняшний день помимо автомобилей Шкода с нашей помощью вы сможете изучить модельный ряд Хендай, Рено, КИА и многих других востребованных на нашем рынке автопроизводителей. Причем, вас ждет в ассортименте более 40 автомобилей, представленных в самых различных богатых комплектациях.</p>', '<h2>Новый Шкода Октавия в кредит</h2>\r\n\r\n<p>Став клиентом нашего автосалона &laquo;ПИК-Авто&raquo;, вы познакомитесь с 6 цветовыми исполнениями, которые помогут вам подобрать автомобиль непосредственно под свой характер. При этом желая приобрести в кредит Шкода Октавия в Москве, вы должны знать, что данные транспортные средства также оборудуются целым рядом дополнительных систем, способных в разы увеличить показатели комфорта для современного автовладельца. К таким модернизациям Шкода Октавия следует отнести:</p>\r\n\r\n<ul>\r\n	<li>Инновационные аудиосистемы;\r\n	<p>Для того чтобы водитель и его пассажиры чувствовали себя предельно комфортно, чешские специалисты позаботились об интеграции на базу транспортного средства аудиосистем последнего поколения. Прямо сейчас, изучая новый Шкода Октавия отзывы владельцев, вы отметите для себя наличие в различных модификациях авто звуковых систем Amundsen, Bolero и, конечно же, Colubbus. Практичность в использовании данных систем обеспечивают сенсорные дисплеи, размером 5.8,6.5 и 8 дюймов, а также интуитивно понятное управление. Отметим, что все системы оснащены слотом для SD-карты и специальными разъемами Aux-in и USB.</p>\r\n	</li>\r\n	<li>Система управления дальним светом ILA;\r\n	<p>Включение или выключение дальнего света теперь происходит на интеллектуальном уровне. За данный процесс в автомобиле отвечает встроенная технология Intelligent Light Assistant. Отметим, что цена на Skoda Octavia в наших автосалонах, даже при присутствии данной системы является более чем доступной.</p>\r\n	</li>\r\n	<li>Функция выбора режима движения;\r\n	<p>Теперь вы, наконец, сможете почувствовать адаптивный характер современных транспортных средств. Новые авто Skoda Octavia оборудуются технологией Driving Mode Selection, которая позволяет автомобилисту самостоятельно настраивать поведение различных систем транспортного средства в соответствии с теми или иными своими предпочтениями. В настоящий момент Driving Mode Selection предусматривает 4 оригинальных режима: Normal, Sport, Eco и Individual (настраиваемый самим автомобилистом).</p>\r\n	</li>\r\n</ul>', '<h2>Цена на Шкода Октавия</h2>\r\n\r\n<p>Основными принципами, на которые опирались дизайнеры Шкода Октавия при создании своего автомобиля, являются спортивный дух и элегантность. Сконцентрировавшись на главном, они убрали все &laquo;лишние&raquo; декоративные элементы и создали образ дорогостоящего легкового транспортного средства, заслуживающего особого внимания со стороны автомобилистов со всего мира. Рассматривая автомобиль Шкода Октавия отзывы, вы отметите для себя достаточно динамичный и в тот же момент строгий внешний облик передней части автомобиля. С боку же разработчики предусмотрели так называемую линию торнадо, которая зрительно удлиняет автомобиль и подчеркивает его обтекаемые купеобразные контуры. Задняя часть кузова также не осталась без внимания специалистов. Она олицетворяет собой современную актуальность, утонченность и идеальные пропорции.</p>\r\n\r\n<p>Интерьер автомобиля выглядит весьма сдержано и элегантно. Его отличает особая вместительность. Отправляясь в дальние поездки, вы обязательно оцените комфорт, реализованный инженерами. Также, в процессе приобретения своей Октавии, вы можете самостоятельно выбирать материалы отделки, их цветовое исполнение и прочие характеристики. При этом все элементы интерьера выполнены из надежных и практичных материалов.</p>\r\n\r\n<p>Помимо Шкоды Октавия мы предлагаем своим клиентам купить КИА Рио, Ниссан Тиана и многие другие транспортные средства, среди которых вы обязательно найдете свой идеал.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:49', '2018-02-19 11:07:49'),
(39, 7, 'Rapid', 'Рапид', 'liftback', 'rapid', '/uploads/model/58a6041a606ba.png', '', '<h1>Купить Шкода Рапид (Skoda Rapid) в Москве у официального дилера</h1>\r\n\r\n<p>Лифтбэк Рапид, созданный автомобильным концерном Шкода, на сегодняшний день является безусловным фаворитом торговой марки на российском автомобильном рынке. Обеспечивая автомобилиста приемлемыми показателями в процессе движения, как в городе, так и на трассе, данный автомобиль олицетворил идеал чешского автопрома. При этом особенно радует вариативность двигателей, комплектации и палитры цветов, которые присутствуют в данном транспортном средстве. Вы можете выбрать и купить Шкода Рапид новый в кредит, который бы соответствовал всем вашим требованиям и пожеланиям.</p>\r\n\r\n<p>Наша специализированная компания &laquo;ПИК-Авто&raquo;, в частности, готова предложить вашему вниманию самые различные комплектации Шкода Рапид в автосалоне. Наладив прямое сотрудничество с производителем, мы предоставляем клиентам предельно гибкие условия приобретения. Причем помимо автомобилей Шкода, в нашем каталоге вы найдете широкий модельный ряд Шевроле, Лада, Ниссан, Лифан и многих других известных на рынке производителей. Ассортимент нашей компании распространяется на более чем 40 транспортных средств, которые собираются на заводах 15 известнейших автомобильных концернов. Также, наши специалисты занимаются продажей не только новых, но и подержанных автомобилей, ввиду чего, с нашей помощью вы обязательно сможете обзавестись автомобилем, реализующим все ваши потребности в плане цены, экономичности и эксплуатации.</p>', '<h2>Новый Шкода Рапид в кредит</h2>\r\n\r\n<p>Рассматривая различные условия приобретения в кредит Шкода Рапид в Москве, вы обязательно познакомитесь с многообразием представленных нами модификаций автомобиля. На сегодняшний день мы предлагаем своим клиентам приобрести Шкода Рапид в 9 различных комплектациях. Причем, вас порадуют 4 вариации двигателя, с параметрами каждого из которых вы с легкостью сможете познакомиться посредством нашего тематического портала. Что же касается непосредственно достоинств Рапида, то к ним следует отнести:</p>\r\n\r\n<ul>\r\n	<li>Встроенную систему KESSY;\r\n	<p>Цена на Skoda Rapid предельно усреднена в нашем каталоге. Начиная с комплектации Ambition, вы получаете систему запуска и доступа на расстоянии. Автолюбитель может завести транспортное средство, разблокировать его или поставить на блок, не вынимая из собственного кармана ключей.</p>\r\n	</li>\r\n	<li>Аудиосистемы последнего поколения;\r\n	<p>Для получения автомобилистом максимального уровня комфорта, инженеры компании Шкода интегрировали на базу своих транспортных средств модели Рапид лучшие звуковые системы. Таким образом, изучая новый Шкода Рапид отзывы владельцев, вы обязательно ознакомитесь с комментариями, связанными с отменным, чистым звучанием любой композиции.</p>\r\n	</li>\r\n	<li>Высокий уровень безопасности;\r\n	<p>Краш тесты Euro NCAP показали, что авто Skoda Rapid способно стать лучшим выбором каждой европейской семьи. Набрав 5 звезд, автомобиль стал достойным дополнением в линейке именитого бренда.</p>\r\n	</li>\r\n	<li>Встроенная технология ESC;\r\n	<p>Интегрированная система поддержания курсовой устойчивости окажет вам поддержку при возникновении самых различных критических ситуаций на проезжей части. Благодаря данной системе возможность попадания транспортного средства в занос снижается до минимума. При этом в процессе стабилизации автомобиля данная система обращается к другим подсистемам, ASR и ABS.</p>\r\n	</li>\r\n</ul>', '<h2>Цена на Шкода Рапид</h2>\r\n\r\n<p>При реализации дизайна Рапида, опытные инженеры компании опирались на концептуально новые принципы. Их целью было создать автомобиль, который бы отображал в своем облике динамичный и, в тот же момент, современный характер. Таким образом, рассматривая автомобиль Шкода Рапид отзывы, вы обратите внимание на многочисленные комментарии касательно нетривиального подхода разработчиков к формированию контуров экстерьера. Объединенная с решеткой радиатора оптика визуально делает автомобиль более широким. При этом профиль Рапида привлекает к себе внимание уникальными четкими гранями и взвешенными изящными линиями. Особое внимание следует уделить форме задних дверей. Благодаря ответственному отношению дизайнеров она обеспечивает пассажиров Рапида комфортабельной посадкой, предоставляя тем самым больше пространства. Задний вид автомобиля также весьма харизматичен. Резкие строго-очерченные треугольные элементы, расположенные по бокам площадки для размещения номерного знака, являются эффектным дополнением, подчеркивающим особый темперамент автомобиля.</p>\r\n\r\n<p>Интерьер автомобиля при этом обладает достаточно вариативным характером. Вы сами можете выбрать цвет и текстуру самых различных элементов интерьера. Причем, каким бы вариантам вы не отдавали свое предпочтение, производитель гарантирует высокое качество.</p>\r\n\r\n<p>Не удивили вышеизложенные характеристики? Мы предлагаем вам купить Фольксваген Джетта, дизайн которого несколько отличается от Рапида.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:51', '2018-02-19 11:07:51'),
(40, 14, 'Gentra', '', 'sedan', 'gentra_1', '/uploads/model/58a6d3742b672.png', '', '', '', '', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:52', '2018-02-19 11:07:52'),
(41, 14, 'Nexia R3', '', 'sedan', 'nexia_1', '/uploads/model/58a6d4910f2bc.png', '', '', '', '', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:53', '2018-02-19 11:07:53'),
(42, 2, 'Sandero New', 'Сандеро', 'hatchback_5', 'sandero_new', '/uploads/model/58a6eeb3a4d8a.png', '', '<h1>Купить новый Рено Сандеро (Renault Sandero) у официального дилера в Москве</h1>\r\n\r\n<p><strong>Автомобиль, который лаконично вписывается в ритмы шумного мегаполиса и оживленных трасс загородом.</strong> С вместительным и аккуратным хэтчбэком любые препятствия легко преодолеваются. В &laquo;ПИК-Авто&raquo; вы сможете купить новый Рено Сандеро в кредит в его обновленной версии. Изящный и компактный, с потрясающими эксплуатационными качествами, он обязательно впечатлит вас.</p>\r\n\r\n<p><strong>Новый авто Рено Сандеро: цены и комплектации</strong><br />\r\nУже в своей стандартной модификации автомобиль оснащен многофункциональным мультимедийным комплексом и современной роботизированной коробкой передач. Вашему вниманию представляется подробная таблица с описанием каждой версии авто.</p>\r\n\r\n<p>Напомним, какие бы комплектации Рено Сандеро в нашем автосалоне вы ни выбрали, мы подарим вам ценные подарки. Это и полезное оборудование, и страховка, и билет до Москвы для всех жителей регионов РФ.</p>\r\n\r\n<h2>Цена на Рено Сандеро в кредит</h2>\r\n\r\n<p>1993 &ndash; год начала деятельности &laquo;ПИК-Авто&raquo;. Заключая договоры с теми или иными производителями, мы активно снижаем прайс. Поэтому у нас вы найдете самые оптимальные расценки на любые товарные позиции. Что касается подарков и бонусов, то официальный дилер Renault Sandero в Москве &laquo;ПИК-Авто&raquo; компенсирует следующие расходы.</p>\r\n\r\n<p><strong>За счет нашего автосалона:</strong></p>\r\n\r\n<ul>\r\n	<li>билет до Москвы;</li>\r\n	<li>страховка ОСАГО или КАСКО;</li>\r\n	<li>полезные приборы.</li>\r\n</ul>\r\n\r\n<p>В качестве последних предложены парктроники, система навигации, зимние шины, сигнализация и многое другое на выбор клиента. Информация относительного того, что еще включено в указанную цену на Renault Sandero в кредит, доступна в разделе &laquo;<a href="/gifts">подарки</a>&raquo;.</p>', '<h2>Автомобиль Рено Сандеро: отзывы</h2>\r\n\r\n<p>Если проанализировать отзывы владельцев нового Рено Сандеро, можно прийти к следующим выводам. Автомобиль прекрасно адаптирован для езды в наших условиях. Высокий результат достижим благодаря энергоемкой надежной подвеске, высокому клиренсу и другим решениям производителя.</p>\r\n\r\n<p><strong>Компактность и экономичность</strong><br />\r\nВ первую очередь, примечательна компактность машины. Небольшие габариты позволят легко и уверенно перемещаться по городу или за его пределами. Это, естественно, положительно влияет на экономичность. Производитель предлагает широкий ассортимент бензиновых двигателей на выбор от 1,2 литров. К слову, каждый из них полностью соответствует установленным стандартам ЕВРО5.</p>\r\n\r\n<p><strong>Безопасность</strong><br />\r\nУверенное движение обеспечивается усовершенствованной серией дисков и пружин. Особую защиту создают накладки на колесных арках и порогах. Даже в базовой версии машина комплектуется подушками безопасности для водителя и пассажиров, системой распределения тормозных усилий и многим другим.</p>\r\n\r\n<p><strong>Комфорт</strong><br />\r\nОб оптимальной температуре в салоне позаботиться новейшая система климат-контроля. А о развлечении пассажиров и водителя &ndash; современная аудиосистема с возможностью подключения любого гаджета.</p>', '<p><strong>Уникальный облик</strong><br />\r\n<em><strong>Дизайн.</strong></em> Авто Renault Sandero в новой версии имеет более удлиненные габариты. Небольшое удлинение не сказалось на компактности, однако добавило больше простора в салоне.</p>\r\n\r\n<p><span style="font-size:16px;"><strong>!</strong></span> Если дизайн не понравился, предлагаем взглянуть на решения других производителей. Мы являемся <a href="/auto/datsun">официальным дилером Датсун</a> и ряда других автомобилестроительных марок. В нашем обширном каталоге обязательно найдется модель по вашим вкусовым предпочтениям.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:54', '2018-02-19 11:07:54'),
(43, 2, 'Duster New', '', 'suv', 'duster_new', '/uploads/model/58a6f1cc3d8d4.png', '', '<h1>Купить Рено Дастер (Renault Duster) у официального дилера в Москве</h1>\r\n\r\n<p>Легендарный внедорожник с выдающимися ходовыми качествами. Эта модель впечатлит вас богатым оснащением и огромным спектром технологий. В новой версии машина стала еще эффектнее и продуманнее! Авто Renault Duster во всех своих комплектациях представлено в салоне &laquo;ПИК-Авто&raquo;. В вашем распоряжении нулевые процентные ставки и минимальный пакет документов для оформления автокредита.</p>\r\n\r\n<p><strong style="font-size: 125%;">Новый авто Рено Дастер: цены и комплектации</strong><br />\r\nНа выбор представлено несколько вариантов модификаций и широкая линейка двигателей объемом от 1.5 до 2.0 литров. В зависимости от конкретной версии машина оснащается функцией START, которая позволяет включить двигатель в режиме ДУ, стабилизационной системой ESP, мультимедийным комплексом MEDIA-NAV и так далее.&nbsp;</p>\r\n\r\n<p>В любой же своей комплектации Рено Дастер в автосалоне &laquo;ПИК-Авто&raquo; предложен с инновационными электронными системами &laquo;EBA&raquo; и &laquo;EBV&raquo;. Последняя отвечает за равномерное распределение тормозных сил, а первая обеспечивает бесперебойный контроль экстренного торможения.</p>', '<h2>Новый Рено Дастер в кредит &ndash; главные преимущества</h2>\r\n\r\n<p>Поездки на самые непредсказуемые расстояния станут увлекательным путешествием. Смело отправляйтесь в путь! О Вашей безопасности и комфорте уже позаботились инженеры &laquo;RENAULT&raquo;. Здесь вы найдете информацию о преимуществах авто и отзывах его владельцев.</p>\r\n\r\n<p>Поездки на самые непредсказуемые расстояния станут увлекательным путешествием. Смело отправляйтесь в путь! О Вашей безопасности и комфорте уже позаботились инженеры &laquo;RENAULT&raquo;. Здесь вы найдете информацию о преимуществах авто и отзывах его владельцев.</p>\r\n\r\n<p><strong style="font-size: 125%;">Защита в любой ситуации</strong><br />\r\n<strong>Продуманная система безопасности.</strong> Стоит отметить трепетный подход разработчиков к уровню защиты водителей и пассажиров. Купить Рено Дастер (Renault Duster) в Москве у официального дилера даже в его начальных комплектациях возможно с фронтальным и боковыми подушками безопасности и другими устройствами защиты в комплекте. Например, присутствует камера заднего вида, открывающая новые возможности для комфортной парковки и безопасного совершения маневров.</p>\r\n\r\n<p><strong>Дополнительная забота о ваших детях.</strong> Особого внимания заслуживает уникальная система креплений &laquo;ISOFIX&raquo; для детских кресел, которая обеспечивает действительно надежную фиксацию.</p>\r\n\r\n<p><strong style="font-size: 125%;">Комфорт в каждой детали</strong><br />\r\n<strong>Насладитесь превосходством тишины</strong>. В салоне царит спокойствие благодаря бесшумной работе двигателя, модернизации уплотнителей дверей и моторного отделения.</p>\r\n\r\n<p><strong>Активный отдых и спорт стали ближе!</strong> Предусмотрен также большой багажник на 475 литров (максимальный объем &ndash; 1636 литров). В нем легко можно разместить даже крупногабаритный груз. Например, лыжи, велосипед и прочее.</p>\r\n\r\n<p><strong style="font-size: 125%;">Автомобиль Рено Дастер: отзывы водителей</strong><br />\r\nВ первую очередь автолюбители отмечают высокое качество системы безопасности. Даже в экстренных ситуациях машина не подводит, оставаясь надежным транспортным средством. Немаловажным фактором для водителей является и внешнее исполнение. Городской современный дизайн от французского бренда пришелся по нраву покупателям. Еще один аргумент, которым руководствуются автолюбители, повышенный уровень комфорта. По этим причинам отзывы владельцев о новом Рено Дастер встречаются в абсолютном большинстве положительные.</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Если вас не впечатлила данная модель, напомним, что у нас можно также, например, <a href="/auto/lifan">купить Лифан</a>, чьи разработки по дизайну схожи с идеями французского бренда &laquo;RENAULT&raquo;.</p>', '<p><strong style="font-size: 125%;">Уникальный</strong><br />\r\n<em>Экстерьер.</em> Выбрать и купить новый Рено Дастер в кредит или за наличные стоит всем любителям выразительного и эффектного облика авто. В экстерьере акцент сделан на хромированной решетке, колесных дисках и бампере. Все эти детали имеют эксклюзивную форму, и выполнены в едином утонченном стиле.</p>\r\n\r\n<p><em>Интерьер.</em> Лаконичность &ndash; главный ориентир при разработке интерьерной концепции. Ощущается и стремление качественного выполнения. Отсюда, мягкие удобные сиденья, огромное количество пространства, понятная локация вещевых отделений.</p>\r\n\r\n<p><em>Оптика.</em> В систему двойной оптики включены дневные ходовые фары и задние огни. В новой версии они подверглись рестайлингу, получив утонченную форму. Оптика в целом отличается особым стилем и яркостью.</p>\r\n\r\n<p><strong>Похожие модели </strong><br />\r\nЕсли вам нравится внешнее исполнение внедорожника, вам стоит обратить внимание на подобные модели. К примеру, у нас возможно <a href="/auto/nissan/nissan_terrano">купить Ниссан Террано</a>. Оба дизайна схожи между собой.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:55', '2018-02-19 11:07:55'),
(44, 1, 'Solaris New', '', 'sedan', 'solaris_sd_2017', '/uploads/model/58a708171ef0b.png', '', '', '', '', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:56', '2018-02-19 11:07:56');
