(45, 5, 'Almera Sedan New', 'Альмера', 'sedan', 'almera_sedan_new', '/uploads/model/58a6f851d57ec.png', '', '<h1>Купить новый Ниссан Альмера (Nissan Almera) у официального дилера в Москве</h1>\r\n\r\n<p>Справляясь со сложнейшими дорожными условиями, седан Альмера демонстрирует превосходство технического исполнения. Невероятно практичный, он впечатляет элегантным и изысканным дизайном. На него всегда и беспрекословно можно положиться.</p>\r\n\r\n<p>С 1993 года компания &laquo;ПИК-Авто&raquo; реализует автомобили от крупнейших производителей мира. Купить новый Ниссан Альмера в кредит или любое другое транспортное средство возможно по одной из 40 доступных программ кредитования. Мы подготовили лучшие предложения от надежных и проверенных банков страны.</p>\r\n\r\n<p><strong>Новый авто Ниссан Альмера: актуальные цены и комплектации</strong></p>\r\n\r\n<ul>\r\n	<li>Comfort, Welcome, Comfort Plus, Tekna, Comfort A/C с пятиступенчатой механической коробкой передач;</li>\r\n	<li>Comfort A/C, Tekna, Comfort Plus с четырехступенчатой автоматической коробкой передач.</li>\r\n</ul>\r\n\r\n<p>Все указанные комплектации седана Ниссан Альмера в автосалоне &ndash; в наличии. Для вашего удобства на сайте размещена подробная таблица с описанием каждой версии автомобиля. Если после изучения таблицы вопросы все же останутся, мы рады будем предоставить персональную консультацию. Просто свяжитесь с менеджером &laquo;ПИК-Авто&raquo; любым оптимальным для вас способом.</p>\r\n\r\n<h2>Цена на Ниссан Альмера в кредит</h2>\r\n\r\n<p>В салоне предложено <a href="/auto/volkswagen">купить Фольксваген</a>, Лифан, Хендай. В числе партнеров &laquo;ПИК-авто&raquo; также такие легендарные бренды, как Рено, Опель, Шкода, Датсун, Грейт Вол. Все эти бренды уже неоднократно доказывали профессионализм и компетентность, поставляя на мировой рынок свои уникальные разработки. Сотрудничество с ключевыми компаниями, естественно, положительно влияет на ценообразование. Именно поэтому &laquo;ПИК-Авто&raquo; как официальный дилер Nissan Almera в Москве формирует умеренный прайс на каждую товарную позицию.</p>\r\n\r\n<p><strong>На чем вы сэкономите с &laquo;ПИК-Авто&raquo;:</strong></p>\r\n\r\n<ul>\r\n	<li>на дороге до столицы: если вы проживаете в регионе РФ, мы возьмем оплату ваших транспортных расходов на себя;</li>\r\n	<li>на оформлении страхового полиса;</li>\r\n	<li>на дополнительном оборудовании.</li>\r\n</ul>\r\n\r\n<p>Что касается последнего пункта, то цена на Nissan Almera в кредит включает нулевую стоимость следующих устройств: сигнализационная система, парктроник, навигатор, комплект зимней резины и проч. Свой презент клиент выбирает сам! Полный список оборудования, а также условия получения вы найдете на странице &laquo;<a href="/gifts">подарки</a>&raquo;.</p>', '<h2>Автомобиль Ниссан Альмера: отзывы</h2>\r\n\r\n<p>Лаконичный яркий дизайн и впечатляющие технические показатели &ndash; это еще не все, что понравилось автолюбителям в седане. Например, в отзывах владельцы нового Ниссан Альмера отмечают эффективную работу двигателя, который отличается особой надежностью и мощностью. Продуманным остается и комплект защиты: он представлен в проверенных системах и устройствах. Довольны водители и уровнем обеспечиваемого комфорта.</p>\r\n\r\n<p><strong>Предусмотрены:</strong></p>\r\n\r\n<ol>\r\n	<li>современная многофункциональная аудиосистема;</li>\r\n	<li>дистанционное открывание центрального замка;</li>\r\n	<li>своевременный подогрев сидений;</li>\r\n	<li>большая площадь очистки для безупречного обзора;</li>\r\n	<li>дополнительная защита двигателя стальной пластиной;</li>\r\n	<li>полноразмерная запаска в багажном отделении.</li>\r\n</ol>\r\n\r\n<p>Багажник, кстати, достаточно вместителен для транспортировки крупногабаритного груза. Смело отправляйтесь в любые даже самые дальние и непредсказуемые путешествия!</p>', '<p><strong>Ставка на безупречность</strong><br />\r\n<em><strong>Дизайн.</strong></em> Исключительность, функциональность и эстетичность слились воедино в дизайнерской концепции седана. Авто Nissan Almera имеет стильный и гармоничный облик. При этом специалисты не забывают о практичности. Например, ручки дверей и решетка радиатора обработаны стойким защитным антикоррозийным материалом.</p>\r\n\r\n<p><em><strong>Салон.</strong></em> Простор, который впечатляет, и комфорт, который завораживает. Здесь предусмотрена идеальная подвеска и обеспечен высокий уровень шумоизоляции. Любые расстояния преодолимы без ущерба для вашего комфорта.</p>\r\n\r\n<p><span style="font-size:16px;"><strong>!</strong></span> Внешнее оформление не пришлось по вкусу? Обратите внимание на разработки других дизайнеров. Как <a href="/auto/renault">официальный дилер Рено</a> и остальных мировых брендов, &laquo;ПИК-Авто&raquo; представляет огромный каталог автомобилей с разнообразным внешним исполнением.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:57', '2018-02-19 11:07:57'),
(46, 5, 'Qashqai new', 'Кашкай', 'crossover', 'qashqai_new', '/uploads/model/58a6fa00d6d68.png', '', '<h1>Купить Ниссан Кашкай у официального дилера в Москве</h1>\r\n\r\n<p>Обновленная усовершенствованная версия известного внедорожника. Авто Nissan Qashqai с его внушительными габаритами и эксцентричным дизайном выделяется из дорожного потока. Узнайте больше об именитой модели японской корпорации! Для этого в каталоге &laquo;ПИК-Авто&raquo; мы разместили актуальную информацию об особенностях машины и подготовил подробную фотогалерею.</p>\r\n\r\n<p><strong style="font-size: 125%;">Новый авто Ниссан Кашкай: цены и комплектации</strong><br />\r\nКак официальный дилер мы вправе предложить лояльный и прозрачный прайс без наценок. Что касается количества модификаций, то их достаточно много. На выбор предложено целых 23 комплектации Ниссан Кашкай в автосалоне &laquo;ПИК-Авто&raquo;! Поражает и широкая линейка двигателей. &nbsp;Представлены устройства, рассчитанные на самый разный объем (от 1.2 до 2.0 литров).</p>', '<h2>Новый Ниссан Кашкай в кредит</h2>\r\n\r\n<p>Изумительное внешнее исполнение наряду с выдающимися техническими характеристиками обрекли внедорожник на успех. Его предпочли миллионы покупателей, что позволило включить машину в 10-ку самых продаваемых на рынке Европы (статистика за 2012 и 2013 годы). Поэтому в сети встречаются преимущественно позитивные отзывы владельцев о новом Ниссан Кашкай. О чем именно пишут в своих откликах автолюбители?</p>\r\n\r\n<p><strong style="font-size: 125%;">Достойно вашего внимания</strong><br />\r\n<strong>Устойчивая система безопасности</strong></p>\r\n\r\n<p>Наивысшая оценка, по результатам европейского теста &laquo;EuroNCAP&raquo;, как нельзя лучше подтверждает уровень безопасности машины. Купить Ниссан Кашкай (Nissan Qashqai) в Москве у официального дилера производитель предлагает с целым комплексом устройств для надежного и уверенного хода. Это и системы ABS, ESP, EBD, и мониторинг слепой зоны, и круговой видеообзор, и многое другое.</p>\r\n\r\n<p><strong>Однозначный комфорт без компромиссов</strong><br />\r\nС помощью удобной приборной панели возможно отслеживать основные сведения, которые дублируются с бортового компьютера. При этом спину и шейный отдел водителя всегда будет поддерживать уникальное сиденье &ndash; эксклюзивная разработка японского бренда.</p>\r\n\r\n<p><strong>Впечатляющий простор</strong><br />\r\nОсобенно довольны водители автомобиля Ниссан Кашкай (по отзывам) остались стеклянной панорамной крышей. За счет нее создается дополнительный простор в салоне. Что касается пространства в целом, то в салоне легко смогут расположиться пять взрослых людей.</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Считаете себя поклонником японского производства? Тогда вам следует изучить полный ассортимент авто. В нашем модельном ряду вы сможете найти и <a href="/auto/skoda">купить Шкода</a> &ndash; продукцию от еще одной легендарной марки.</p>', '<p><strong style="font-size: 125%;">Выдающийся дизайн</strong><br />\r\n<strong>О концепции в целом. </strong>Блестящее внешнее исполнение авто &ndash; визитная карточка &laquo;NISSAN&raquo;. Каждая модель может похвастаться стремительными кузовными линиями, внушительными габаритами и выразительной оптикой. И Кашкай &ndash; не исключение.</p>\r\n\r\n<p><strong>Палитра. </strong>Производитель предложил купить новый Ниссан Кашкай в кредит в следующих вариантах: комбинации серого, бронзовый, красный и синий, черный, различные оттенки белого.</p>\r\n\r\n<p><strong>Особенности оптики. </strong>Огни не только обличены в привлекательную форму. Они также отличаются высокой эффективностью. Инновационные светодиодные фонари обеспечивают отличную видимость в любое время суток и любую непогоду. Ваше движение &ndash; максимально комфортно и безопасно!</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Обратите внимание на ряд других моделей, выполненных в подобном стиле. Среди похожих вариантов, например, продукты легендарного бренда &laquo;VOLKSWAGEN&raquo;. В &laquo;ПИК-Авто&raquo; возможно <a href="/auto/volkswagen/tiguan/">купить Фольксваген Тигуан</a> и остальные автомобили этой компании.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:57', '2018-02-19 11:07:57'),
(47, 5, 'X-Trail New', 'Икс Трейл', 'crossover', 'x_trail_new', '/uploads/model/58a7090c1926a.png', '', '<h1>Купить Ниссан Икстрэйл у официального дилера в Москве</h1>\r\n\r\n<p>Новый внедорожник &laquo;X-TRAIL&raquo; стал еще мощнее и эффектнее! Приобретя более утонченный внешний вид, авто Nissan X-Trail завоевал любовь еще большего количества водителей. &laquo;ПИК-Авто&raquo; вместе с лидирующими банками страны поможет выгодно купить данную модель практически любому желающему.</p>\r\n\r\n<p><strong style="font-size: 125%;">Новый авто Ниссан Икстрэйл: цены и комплектации</strong></p>\r\n\r\n<p>Как и всегда, производитель представил огромную серию модификаций, расцветок, двигателей. В числе последних, естественно, только мощные и производительные устройства, обеспечивающие быструю и комфортную езду. Мы собрали все актуальные комплектации Ниссан Икстрэйл в автосалоне, чтобы вы смогли выбрать наиболее подходящую модификацию.</p>', '<h2>Новый Ниссан Икстрэйл в кредит</h2>\r\n\r\n<p>Свежая модернизация авто &ndash; далеко не первая. До этого внедорожник подвергался рестайлингу и технической &laquo;шлифовке&raquo; в 2001-ом и 2007-ом годах. С каждым разом машина становилась все совершеннее и технологичнее. Расскажем, о чем пишут в отзывах владельцы нового Ниссан Икстрэйл, и чем примечательна именно его последняя версия.</p>\r\n\r\n<p><strong style="font-size: 125%;">Справка</strong><br />\r\n<strong>Непревзойденная безопасность</strong><br />\r\nНеизменно авторитетный краш-тест &laquo;EuroNCAP&raquo; ставит твердую &laquo;пятерку&raquo; внедорожнику за безопасность. И это не удивительно: здесь предусмотрено абсолютно все для надежной защиты в любой ситуации. Уверенный ход и нормальное торможение обеспечивает &laquo;трио&raquo; из систем &laquo;EBD&raquo;, &laquo;ABS&raquo; и &laquo;ESP&raquo;. Кроме того, безопасность здесь выступает наряду с комфортом. Например, если купить Ниссан Икстрэйл (Nissan X-Trail) в Москве у официального дилера с трехмерным видеообзором, можно более точно и качественно совершать те или иные маневры, затрачивая при этом минимум усилий.</p>\r\n\r\n<p><strong>Комфорт, который впечатляет </strong></p>\r\n\r\n<ul>\r\n	<li>наслаждайтесь любимой музыкой с помощью мощных колонок аудиосистемы;</li>\r\n	<li>отслеживайте информацию с бортового компьютера с помощью многофункциональной приборной панели;</li>\r\n	<li>почувствуйте восторг дорожных поездок с помощью мягких рельефных сидений.</li>\r\n</ul>\r\n\r\n<p><strong>Впечатляющий простор</strong><br />\r\nВодители автомобиля Ниссан Икстрэйл в отзывах высоко оценивают здешний простор. Отмечают также отличную вместительность багажного отделения.</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Если вам по нраву японские машины, рекомендуем рассмотреть все варианты. Например, у нас возможно <a href="/auto/skoda">купить Шкода</a> &ndash; современные авто ведущего бренда Японии.</p>', '<p><strong style="font-size: 125%;">Впечатляющий</strong><br />\r\n<strong>Цветовая палитра.</strong> Купить Новый Ниссан Икстрэйл в кредит возможно в таких цветах, как черный, серебристый, синий, серый, белый. Из более оригинальной комбинации стоит выделить &laquo;оливковый&raquo; и &laquo;янтарный&raquo;.</p>\r\n\r\n<p><strong>Внешнее исполнение. </strong>Спортивная конструкция, яркие сочные расцветки и эксклюзивная форма колес. С таким экстерьером вы никогда не останетесь незамеченным на дороге!</p>\r\n\r\n<p><strong>Салон.</strong> Изумительная отделка и панорамная крышка, большая площадь лобового стела и простор &ndash; все это создает невероятный комфорт управления и позволяет насладиться движением. &nbsp;</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Вам нужен более экономичный автомобиль? Тогда вам стоит <a href="/auto/kia/sportage_new/">купить Киа Спортейдж</a>. Цена на эту модель ниже, а внешне &ndash; машины схожи между собой.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:07:59', '2018-02-19 11:07:59'),
(48, 5, 'Terrano', 'Террано', 'suv', 'nissan_terrano', '/uploads/model/58a70ad8e18ea.png', '', '<h1>Купить Ниссан Террано у официального дилера в Москве</h1>\r\n\r\n<p>Уникальный внедорожник с выдающимися ходовыми качествами однозначно заслуживает вашего внимания. Потрясающее внешнее исполнение и технические преимущества оценили уже миллионы автолюбителей, выбрав авто Nissan Terrano. Наш салон подготовил подробную информацию о легендарной японской модели.</p>\r\n\r\n<p><strong style="font-size: 125%;">Новый авто Ниссан Террано: цены и комплектации</strong><br>Разработчики продолжают удивлять огромным выбором модификаций и расценок. Среди такого количества версий, пожалуй, каждый сможет найти авто по своим финансовым возможностям и пожеланиям. &laquo;ПИК-Авто&raquo; собрал все комплектации Ниссан Икстрэйл в автосалоне. Увидеть, что предполагает каждая из них, вы сможете на сайте в режиме онлайн. На странице представлена подробная таблица с характеристикой каждой из модификаций.</p>', '<h2>Новый Ниссан Террано в кредит</h2>\r\n\r\n<p>Внушительные габариты, яркий дизайн и отличные ходовые характеристики стали определяющими для успеха Террано. С первых дней своего появления на авторынке, машина мгновенно получила признание. Новый Ниссан Террано получил положительные отзывы владельцев, завоевав лидирующие строчки в списке самых продаваемых авто.</p>\r\n\r\n<p><strong style="font-size: 125%;">Информация</strong><br />\r\n<strong>Безопасность на &laquo;пять баллов&raquo;</strong><br />\r\nКак и все модели торговой марки, &laquo;TERRANO&raquo; успешно преодолел испытания краш-теста &laquo;EuroNCAP&raquo;. Он смог получить максимальное количество баллов за &laquo;безопасность&raquo; (пять из пяти). Упрочненный кузов и оснащение самыми современными устройствами позволили добиться такого результата.</p>\r\n\r\n<p><strong>Купить Ниссан Террано (</strong><strong>Nissan</strong> <strong>Terrano</strong><strong>) в Москве у официального дилера</strong><strong> вы можете со следующими устройствами и системами: </strong></p>\r\n\r\n<ol>\r\n	<li>&laquo;ABS&raquo;;</li>\r\n	<li>круговой трехмерный видеообзор;</li>\r\n	<li>&laquo;ESP&raquo;;</li>\r\n	<li>мониторинг слепых зон;</li>\r\n	<li>&laquo;EBD&raquo; и многое другое.</li>\r\n</ol>\r\n\r\n<p><strong>Совершенный комфорт</strong><br />\r\nРоскошная отделка салона завораживает с первых секунд. Мягкая и приятная на ощупь ткань создает невероятный комфорт движения. А рельефные сиденья &ndash; инновационная разработка &laquo;NISSAN&raquo; - &nbsp;сделают даже продолжительную поездку приятным времяпрепровождением. Водители автомобиля Ниссан Террано в отзывах также высоко оценивают работу мультимедийного комплекса.</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Привлекает японский автопром? Тогда вам следует рассмотреть полный модельный ряд, чтобы сделать правильный выбор. Возможно, вы решите <a href="/auto/skoda">купить Шкода</a> &ndash; стильные авто достойного качества.</p>', '<p><strong style="font-size: 125%;">Изумительная внешность</strong><br />\r\n<strong>Варианты расцветок. </strong>Купить Новый Ниссан Террано в кредит или за наличные производитель предложил в одном из шести оттенков. Разработчик ограничился умеренной холодной серией преимущественно из вариативных комбинаций серого цвета.</p>\r\n\r\n<p><strong>Дизайн.</strong> Внимание окружающих в первую очередь притягивают следующие детали: оригинальные дуги на крыше кузова, хромированная изящная решетка радиатора, выдающийся внушительный каркас. Как настоящий внедорожник Террано выглядит мощным, эффектным и сильным.</p>\r\n\r\n<p><strong>Интерьер</strong>. Все компоненты интерьера &ndash; в идиллии и гармонии. Стили приборной панели, вещевых отделений, дверей, сидений перекликаются между собой, создавая единую лаконичную концепцию.</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Понравился Террано, но ищите более бюджетный вариант? Рекомендуем <a href="/auto/chevrolet/niva/">купить Шевроле Нива</a>. Эта машина имеет похожий дизайн.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:08:01', '2018-02-19 11:08:01'),
