(58, 16, 'Focus New Sedan', '', 'sedan', 'focus_sd', '/uploads/model/58a74c7adb9ba.png', '', '<h1>Купить Форд Фокус у официального дилера в Москве</h1>\r\n\r\n<p>Элегантность и благородство &ndash; основные критерии для внешнего оформления модели. На этой странице вы найдете описание и фотографии авто Ford Focus. С помощью партнеров нашего автосалона возможно взять выгодный кредит на любую выбранную вами машину. Мы заключили договоры с ключевыми финансовыми корпорациями страны: &laquo;СберБАНК&raquo;, &laquo;ВТБ24&raquo;, &laquo;Русский Стандарт&raquo; и так далее.</p>\r\n\r\n<p><strong style="font-size: 125%;">Новый авто Форд Фокус: цены и комплектации</strong><br>Всего насчитывается 8 модификаций седана. В линейке двигателей &ndash; устройства на 1.5 и 1.6 литров. Трансмиссии же предложены обе: механическая и автоматическая. Отметим, какие бы комплектации Форд Фокус в автосалоне вы ни выбрали, вы всегда будете обеспечены и безопасностью, и достойным уровнем комфорта.</p>', '<h2>Новый Форд Фокус в кредит &ndash; почему именно он?</h2>\r\n\r\n<p>Ищите стильный городской седан? Тогда стоит остановить свой выбор на легендарном &laquo;Фокусе&raquo;. Почему? Мы подготовили для вас ряд актуальных весомых причин, которые составили по отзывам владельцев нового Форд Фокус.</p>\r\n\r\n<p><strong>Причина 1. Комфортное управление</strong><br />\r\nМягкий и плавный ход обеспечивается всеми устройствами, системами, деталями авто. В результате движение становится максимально легким и уверенным, а вождение превращается исключительно в приятное времяпрепровождение.</p>\r\n\r\n<p><strong>Причина 2. Впечатляющий уровень безопасности</strong><br />\r\nПройдя огромное количество краш-тестов, модель продемонстрировала наивысший уровень надежности. Его безопасность подтверждается и народным мнением: автомобиль Форд Фокус, согласно отзывам водителей, достойно проявляет себя в критичных ситуациях.</p>\r\n\r\n<p><strong>Причина 3. Современный дизайн</strong><br />\r\nКак и всегда экстерьер &laquo;FORD&raquo; полностью отвечает мировым тенденциям автомобильной моды. Отсюда, элегантный мускулистый силуэт, стремительные линии, эффектная стильная оптика.</p>\r\n\r\n<p><strong>Причина 4. Качественная отделка салона</strong><br />\r\nПод этим пунктом понимается не только превосходное исполнение сидений. В салоне, например, достаточно просторно. Что позволяет купить Форд Фокус (Ford Focus) в Москве у официального дилера для путешествий и поездок большими компаниями.</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Рекомендуем оценить модели других американских брендов. У нас вы сможете <a href="/auto/chevrolet">купить Шевроле</a> &ndash; самые именитые его автомобили.</p>', '<p><strong style="font-size: 125%;">Дизайн будущего</strong></p>\r\n\r\n<p><strong>Цветовое исполнение.</strong> Купить новый Форд Фокус в кредит предложено в девяти разнообразных вариантах. В основном цветовая палитра насыщена холодными и спокойными оттенками. Однако присутствуют и яркие красочные тона (например, красный).</p>\r\n\r\n<p><strong>Дизайнерская концепция.</strong> Экстерьер выполнен в духе &laquo;FORD&raquo;. Разработчики представили кинетический эксклюзивный дизайн корпорации. В его основе же &ndash; стремительность, динамика, элегантность. Что касается новшеств, то в свежей серии модель имеет рельефные мускулистые линии капота.</p>\r\n\r\n<p><strong>Оптика.</strong> Сразу отметим, что потрясающая внешность &ndash; не единственное преимущество оптики седана. В первую очередь все огни отличаются экономичностью. Наиболее удачная разработка &ndash; биксеноновые фары, которые выгодно выделяются среди своих галогеновых конкурентов.</p>\r\n\r\n<p><b style="font-size: 125%;">!</b> Кстати, похожую дизайнерскую концепцию имеет ряд других автомобилей. Оцените их исполнение. Например, у нас можно <a href="/auto/ravon/gentra_1">купить Равон Гентра</a> &ndash; весьма похожую модель.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:08:12', '2018-02-19 11:08:12'),
