(66, 4, 'RIO SEDAN NEW', 'Рио', 'sedan', 'rio_sedan_2015', '/uploads/model/58aa8fbbe2cf3.png', '', '<h1>Купить новый Киа Рио (Kia Rio) у официального дилера в Москве</h1>\r\n\r\n<p><strong>Яркий и спортивный.</strong> Представляем обновленную версию легендарного седана Киа Рио. Теперь он еще комфортнее, безопаснее и удобнее. Усовершенствованный своим создателем, автомобиль стал более инновационным и адаптированным для поездок в современном мегаполисе.</p>\r\n\r\n<p>В салоне &laquo;ПИК-Авто&raquo; предложено купить новый Киа Рио в кредит от ведущих банков страны. Крупнейшие финансовые организации разработали свыше 40 вариантов кредитования. Изучайте условия всех доступных программ и выбирайте любую из комплектаций автомобиля.</p>\r\n\r\n<p><strong>Новый авто Киа Рио: доступные цены и комплектации</strong><br />\r\n▶ Comfort;<br />\r\n▶ Luxe;<br />\r\n▶ Prestige;<br />\r\n▶ Premium.</p>\r\n\r\n<p>Стандартные комплектации Киа Рио в автосалоне включают в себя надежные системы ABS и ESS, электропривод стеклоподъемников, передние и задние дисковые тормоза, дополнительный стоп-сигнал и многое другое. Предлагаем ознакомиться с подробной таблицей характеристик модели.</p>\r\n\r\n<h2>Цена на Киа Рио в кредит</h2>\r\n\r\n<p>Официальный дилер Kia Rio в Москве с 1993 года активно сотрудничает с ведущими автомобилестроительными марками мира. Возможность прямых поставок гарантирует сохранение умеренных и демократичных цен на все позиции. Помимо доступного прайса мы предоставляем нашим покупателям полезные подарки. Более того, берем часть клиентских расходов на себя.</p>\r\n\r\n<p><strong>Купим за вас:</strong></p>\r\n\r\n<ul>\r\n	<li>билет до Москвы (предложение действительно для жителей регионов России);</li>\r\n	<li>страховку &laquo;КАСКО&raquo; или &laquo;ОСАГО&raquo;.</li>\r\n</ul>\r\n\r\n<p>Что еще включает в себя цена на Kia Rio в кредит, указанная на сайте? Такие дополнительные устройства, как парктроник, навигатор, сигнализацию, зимнюю резину и прочее. Их вы получаете бесплатно от нашего салона. Какие презенты вы сможете получить уже сегодня, узнайте на странице &laquo;<a href="/gifts">подарки</a>&raquo;. Все актуальные акции обновляются в этом разделе.</p>', '<h2>Автомобиль Киа Рио: отзывы</h2>\r\n\r\n<p>Изучив отзывы владельцев нового Киа Рио, вы придете к следующим выводам. Во-первых, даже в базовых комплектациях в седане предусмотрено все для комфортных поездок. Во-вторых, автомобиль невероятно надежен и безопасен. В-третьих, он идеально подходит как для повседневной жизни, так и для увлекательных путешествий.</p>\r\n\r\n<p><strong>Нововведения</strong></p>\r\n\r\n<ul>\r\n	<li>увеличенная емкость аккумулятора;</li>\r\n	<li>обработка радиатора специальным защитным составом;</li>\r\n	<li>увеличенный объем бачка омывающей жидкости.</li>\r\n</ul>\r\n\r\n<p><strong>Защита.</strong> Все уязвимые части машины покрыты стойким антикоррозийным материалом. Это относится к порогам, аркам колес и днищу.</p>\r\n\r\n<p><strong>Вождение.</strong> Для облегчения управления предусмотрены датчики парковки. С их помощью вы сможете увидеть картинку с задней камеры. Изображение, кстати, транслируется на большой дисплей бортового компьютера.</p>\r\n\r\n<p><strong>Багажное отделение.</strong> Отправляйтесь в самые дальние путешествия! В седане установлен многофункциональный багажник, рассчитанный на 500 литров.</p>', '<p><strong>Единственный в своем роде</strong><br />\r\n<em><strong>Дизайн.</strong></em> В седане превосходно гармонируют спортивный, динамичный силуэт и изысканные детали. Яркий образ и насыщенные сочные цвета &ndash; этот седан не останется незамеченным на дороге.</p>\r\n\r\n<p><em><strong>Оптика.</strong></em> Авто Kia Rio впечатляет эстетичной оптикой. Например, светодиодные огни являются неким завершением спортивного стиля. А задние фонари привносят особую индивидуальность, являясь совершенно эксклюзивной деталью.</p>\r\n\r\n<p><em><strong>Салон.</strong></em> Интерьер отличается особой элегантностью и эргономичностью. Он лишен ненужных деталей, поэтому выглядит лаконично и просто. Немаловажную роль играет и простор: здесь смогут спокойно расположиться пять взрослых пассажиров.</p>\r\n\r\n<p><span style="font-size:16px;"><strong>!</strong></span> Не понравился дизайн Рио? Обратите внимание на модельный ряд <a href="/auto/hyundai">Hyundai</a> или других марок. В нашем каталоге представлены десятки различных автомобилей, среди которых обязательно окажется тот, что придется по вкусу именно вам.</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:08:18', '2018-02-19 11:08:18'),
(67, 4, 'CEED', 'Сиид', 'hatchback_5', 'ceed', '/uploads/model/58aa959524d72.png', '', '<h1>Купить новый Киа Сид (Kia Ceed) у официального дилера в Москве</h1>\r\n\r\n<p><strong>Динамичный, функциональный и спортивный.</strong> Если вы давно искали комфортный и безопасный автомобиль для суетной жизни мегаполиса, отдайте предпочтение Киа Сид. Оснащенный интеллектуальными системами, он превратит любую вашу поездку в увлекательное путешествие.</p>\r\n\r\n<p>В &laquo;ПИК-Авто&raquo; вы сможете купить новый Киа Сид в кредит без процентов и первого взноса. На счету наших партнерских банков более 40 программ автокредитования. Каждая из них предполагает лояльные и удобные условия оформления договора. Выбирайте любую из них для приобретения той или иной модификации авто.</p>\r\n\r\n<p><strong>Новый авто Киа Сид: доступные цены и комплектации</strong></p>\r\n\r\n<ul>\r\n	<li>Classic;</li>\r\n	<li>Comfort;</li>\r\n	<li>Luxe;</li>\r\n	<li>Prestige;</li>\r\n	<li>Premium.</li>\r\n</ul>\r\n\r\n<p>О том, что включено в конкретную комплектацию Киа Сид в автосалоне, вы узнаете на сайте. Предлагаем ознакомиться с простой таблицей характеристик. На любые возникшие вопросы по оснащению модификаций ответят менеджеры &laquo;ПИК-Авто&raquo;.</p>\r\n\r\n<h2>Цена на Киа Сид в кредит</h2>\r\n\r\n<p>С 1993 года &laquo;ПИК-Авто&raquo; - официальный дилер Kia Ceed в Москве. В нашем ассортименте также представлены другие модели от 15 крупнейших мировых производителей. Сотрудничество с именитыми брендами позволяет нам формировать умеренный прайс-лист на все из товарных позиций. Более того, ряд ваших расходов сокращается за счет бонусов, акций и подарков от салона.</p>\r\n\r\n<p><strong>На чем вы экономите:</strong></p>\r\n\r\n<ul>\r\n	<li>дорога до столицы;</li>\r\n	<li>страховой полис &laquo;КАСКО&raquo; или &laquo;ОСАГО&raquo;;</li>\r\n	<li>дополнительное полезное оборудование*.</li>\r\n</ul>\r\n\r\n<p><em>*Подарки.</em> Цена на Kia Ceed в кредит &ndash; окончательная. Ведь массу дополнительных устройств (парктроники, зимние шины, навигатор, система сигнализации и др.) вы получаете в подарок. Выбрать нужный презент вы также сможете самостоятельно. Актуальная информация доступна на странице &laquo;<a href="/gifts">подарки</a>&raquo;. Следите за обновлениями!</p>', '<h2>Автомобиль Киа Сид: отзывы</h2>\r\n\r\n<p>Согласно отзывам владельцев, новый Киа Сид &ndash; эталон технической и дизайнерской концепции. Это подтверждает и отношение разработчика авто: производитель предоставляет гарантию на 5 лет эксплуатации или 150 000 километров пробега. Автолюбители отмечают продуманность салона: здесь все под рукой. Мягкие сиденья выполнены из высококачественных изделий, во внешнем исполнении чувствуется особый шик, изысканность и шарм. Еще большую роскошь создает утонченная подсветка салона.</p>\r\n\r\n<p>За комфорт водителя и пассажиров отвечает множество различных интеллектуальных систем. Какие именно?</p>\r\n\r\n<ol>\r\n	<li><u><strong>Автоматическая помощь во время парковки.</strong></u> Припарковаться теперь легко и просто даже в самых сложных условиях. RCTA &ndash; интеллектуальная система &ndash; обеспечит контроль авто, движущегося в поперечном направлении.</li>\r\n	<li><u><strong>Многофункциональная современная аудиосистема.</strong></u> Прослушивайте любимые композиции с вашего гаджета. Имеются входы IPOD, AUX, USB.</li>\r\n	<li><u><strong>Новейшая камера заднего вида.</strong></u> Четкая картинка с камеры передается на большой дисплей вашей системы навигации.</li>\r\n</ol>', '<p><strong>Неизменно яркий</strong><br />\r\n<em><strong>Дизайн.</strong></em> Мускулистая плечевая линия и невероятно фактурный клиновидный профиль. Образ машины пышет особой мощью и силой. Кстати, в дизайнерской концепции прослеживаются характерные черты спорткупе. Здесь и удлиненная колесная база, и приземистая удобная посадка. Авто Kia Ceed имеет современный и яркий дизайн.</p>\r\n\r\n<p>Не понравилось внешнее оформление авто? Просмотрите дизайн моделей от других производителей Кореи. Например, модельный ряд <a href="/auto/hyundai">Hyundai</a>. Мы уверенны, среди огромного количества авто вы найдете машину по своему вкусу!</p>', '', 0, 1, NULL, NULL, NULL, '2018-02-19 11:08:20', '2018-02-19 11:08:20'),
