INSERT INTO `pages` (`id`, `title`, `slug`, `meta_keywords`, `meta_desc`, `content`, `icon`, `published`, `published_at`, `blog_post`, `created_at`, `updated_at`) VALUES
(1, 'О компании', 'about', '', '', '<p>Впервые автомобили марки Renault появились в России еще в начале двадцатого века: именно на них передвигалась по городу императорская семья. В 1916 году было создано акционерное общество «Русский Рено», и в Рыбинске началось строительство завода Renault, который был национализирован после революции. Политика СССР предусматривала развитие собственного автомобилестроения, но в 1960-х годах компания Renault возобновила сотрудничество с Москвой. В 1970 году правительство СССР заключило с французским концерном соглашение о развитии автомобильной промышленности. К 1980 году около четверти советских автомобилей производились по технологии Renault.</p>\r\n<p>В 1992–1993 годах компания Renault открыла первый российский офис в Москве, а в июле 1998 года было подписано соглашение с правительством Москвы о создании совместного предприятия «Автофрамос». Это название было скомпоновано из слов «авто», «Франция» и «Москва». Через год на базе завода АЗЛК был открыт цех неполной сборки, который выпускал автомобили Renault MEGANE и Renault 19, а затем CLIO Symbol. В 2003 году началось строительство завода полного цикла для производства Renault LOGAN, завершившееся в апреле 2005-го. Уже в 2006 году LOGAN стал самым продаваемым иностранным автомобилем в России. Доля Renault в капитале ОАО «Автофрамос» постепенно увеличивалась, пока в ноябре 2012 года не дошла до 100 %. В июле 2014 года российское предприятие сменило название на ЗАО «Рено Россия», напрямую связав свое имя со славной историей компании.</p>\r\n<div class="about_bg"></div>\r\n\r\n\r\n', '', 1, '2018-01-26 12:28:53', 0, '2016-03-31 03:24:42', '2018-01-26 09:28:53'),
(6, 'Новость 1', 'news1', '', '', '<p>Знаешь, у тебя красивое имя, изящные формы и пылкий характер. Каждый раз тембр твоего мотора все сильнее разжигает пламя в моем сердце и поток чистых эмоций</p>\r\n', '', 1, '2018-01-23 13:43:45', 1, '2018-01-23 10:43:45', '2018-01-23 10:43:45'),
(7, 'Новость 2', 'news2', '', '', '<p>Встречайте #Nissan #Qashqai Quantum Edition &ndash; дебютанта в обновленном модельном ряду легендарного кроссовера! Новинка представлена в версиях QE и QE+&hellip; зависимости от комплектации оснащена системой &laquo;ЭРА-ГЛОНАСС&raquo;</p>\r\n', '', 1, '2018-01-23 13:44:19', 1, '2018-01-23 10:44:19', '2018-01-23 10:44:19'),
(8, 'Новость 3', 'news3', '', '', '<p>Знаешь, у тебя красивое имя, изящные формы и пылкий характер. Каждый раз тембр твоего мотора все сильнее разжигает пламя в моем сердце и поток чистых эмоций</p>\r\n', '', 1, '2018-01-23 13:44:47', 1, '2018-01-23 10:44:47', '2018-01-23 10:44:47'),
(9, 'Документы', 'documents', '', '', '<div class="documents_block">\r\n<h3>Преимущества оформления кредита</h3>\r\n\r\n<ul class="disk">\r\n	<li>Процентная ставка от 1,3% годовых</li>\r\n	<li>Первоначальный взнос от 10%</li>\r\n	<li>Сумма кредитования до 3 500 000 руб.</li>\r\n	<li>Срок кредита от 6 месяцев до 10 лет</li>\r\n	<li>Возможность сдать свой автомобиль в качестве первоначального взноса (trade-in)</li>\r\n	<li>Возможность досрочного погашения кредита без штрафов и комиссий</li>\r\n</ul>\r\n</div>\r\n\r\n<div class="documents_block">\r\n<h3>Пакеты документов для автокредита</h3>\r\n\r\n<ul class="pdf">\r\n	<li><a href="">Минимальный</a></li>\r\n	<li><a href="">Желательно для физических лиц</a></li>\r\n	<li><a href="">Обязательно для ИП</a></li>\r\n	<li><a href="">Договор купли-продажи</a></li>\r\n	<li><a href="">Кредитный договор</a></li>\r\n</ul>\r\n<a class="btn" href="/credit">Заполнить заявку на автокредит</a></div>\r\n\r\n<div class="credits">\r\n<h2>Вашу заявку на кредит рассмотрят наши банки-партнеры:</h2>\r\n\r\n<ul class="row">\r\n	<li><img src="/images/banks/1.png" /></li>\r\n	<li><img src="/images/banks/2.png" /></li>\r\n	<li><img src="/images/banks/3.png" /></li>\r\n	<li><img src="/images/banks/4.png" /></li>\r\n	<li><img src="/images/banks/5.png" /></li>\r\n	<li><img src="/images/banks/6.png" /></li>\r\n	<li><img src="/images/banks/7.png" /></li>\r\n	<li><img src="/images/banks/8.png" /></li>\r\n	<li><img src="/images/banks/9.png" /></li>\r\n</ul>\r\n\r\n<ul class="row">\r\n	<li><img src="/images/banks/10.png" /></li>\r\n	<li><img src="/images/banks/11.png" /></li>\r\n	<li><img src="/images/banks/12.png" /></li>\r\n	<li><img src="/images/banks/13.png" /></li>\r\n	<li><img src="/images/banks/14.png" /></li>\r\n	<li><img src="/images/banks/15.png" /></li>\r\n	<li><img src="/images/banks/16.png" /></li>\r\n	<li><img src="/images/banks/17.png" /></li>\r\n	<li><img src="/images/banks/18.png" /></li>\r\n</ul>\r\n</div>\r\n', '', 1, '2018-01-31 12:23:25', 0, '2018-01-26 09:09:20', '2018-01-31 09:23:25');
